INSERT INTO `coins` VALUES (1294,1182,1,'BTC','Bitcoin',9304.64957,1.00,0.012602,14656221049.81000,1.00,167725613101.36,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/btc.svg','1',1,'https://bitcoin.org/en/','SHA-256','PoW','21000000','Bitcoin (₿) (BTC) is a decentralized virtual digital currency that can be sent between users through the Bitcoin peer-to-peer network, without the need for intermediaries like banks or governments. It was the first example of a cryptocurrency, a growing asset class that shares some characteristics of traditional currencies, but has verification based on cryptography. \n\n The term ‘Bitcoin’ can refer to the token (a snippet of code that represents ownership of a digital value) or it can refer to the technology (a distributed network that maintains the ledger of balances of the Bitcoin token). \n\n The idea for Bitcoin and blockchain was first published in an online cryptography forum in November 2008, by an anonymous person (or group) called Satoshi Nakamoto. The white paper, entitled ‘Bitcoin: A Peer-to-Peer Electronic Cash System’ outlined an electronic payment system based on mathematical proof, and explained how the different parts of the Bitcoin protocol would operate and be kept secure. It further described how a new type of database called a blockchain would keep track of the history of all Bitcoin transactions, and be maintained by everyone in the network. \n\n Bitcoin was first released as version 0.1 in January 2009, by Satoshi and was published on SourceForge, an online collaboration platform for developers. Anyone could download the source code and run it to join the network. Satoshi continued to write the Bitcoin code until 2010 and then handed it over to the open source community. The smallest unit of a Bitcoin is called a Satoshi after its founder(s) and represents one-hundred-millionth of a Bitcoin. The first Bitcoin was created when Satoshi mined the first block of the chain, known as the genesis block. \n\n There is said to be a limit of ₿21 million which can be mined. The supply is tightly controlled by an underlying algorithm. So, like gold, there is a limited and finite supply. Unlike the currencies issued by banks and governments, Bitcoin is not vulnerable to losing its value if the centralized issuing authority breaks down. The decentralized system can continue to operate as long as there are members in the network. \n\n The managing of transactions and the issuing of Bitcoins is carried out collectively by the network. Bitcoin is open-source, its design is public, nobody owns or controls Bitcoin and everyone can take part. It is maintained by a group of volunteer coders and run by an open network of dedicated computers spread around the world. \n\n Bitcoins are created as a reward for a process known as mining, which comprises adding transaction records (or blocks of code) to Bitcoin\'s public ledger (or chain) of past transactions and keeping them in the queue. Blocks are chopped off as each transaction is finalized, codes deciphered, and Bitcoins passed or exchanged. Miners use special software to solve the math problems that keep the Bitcoin process secure and are issued a certain number of Bitcoins in return. This provides a smart way to issue the currency and also creates an incentive for more people to mine.','0','0','2019-09-12 23:08:19','2019-11-02 18:25:47',77301054437.29,360091640997.92,0.00,0.00,0.011350,0.129856,-0.149976,0.168675,2228.79149500),(1295,7605,2,'ETH','Ethereum',184.24094,1.00,0.017742,5293310131.57000,1.00,19971183543.13,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/eth.svg','1',1,'https://www.ethereum.org/','Ethash','PoW',' ','Ether (ETH) (Ξ) is a cryptocurrency whose blockchain is generated by the Ethereum network. Unlike Bitcoin, which aims to disrupt the banking system with its own digital currency, the Ethereum platform’s goal is to use blockchain to replace internet third parties, particularly those that store data, transfer mortgages, and keep track of complex financial instruments. \n\n Ethereum is made up of nodes run by volunteers across the world, the nodes form what has been described as a ‘world computer’, a decentralized mining network which is not governed by any third parties like, for example, servers and clouds are. \n\n The volunteers, or miners, use their own computational power (gas) to run the network. This involves passing blocks of code between each other and solving the mathematical problems that keep the code secure in exchange for Ether. The currency is listed on exchanges, and can only be used on the Ethereum blockchain. It is used to pay for gas and transaction fees. \n\n Ethereum is open-source, public, and highly programmable. Anyone can use or modify its software to build upon the computing platform and operating system. The platform gives developers the opportunity to build their own digital assets on the Ethereum infrastructure without having to create their own blockchain. This has given rise to hundreds of Ethereum blockchain based tokens (such as Binance Coin, Golem, and Basic Attention Coin). In 2017, at the height of crypto-mania Ethereum was leading blockchain platform for Initial Coin Offering  (ICO) projects, with over 50% market share. \n\n The Ethereum concept was initially described in a white paper by Vitalik Buterin, a Russian-Canadian programmer in late 2013. He believed that Bitcoin needed a scripting language for application development. When he was unable to gain agreement, he devised a new platform with a more general scripting language. Development was funded by an online crowdsale that took place between July and August 2014, with the Ethereum system going live on 30 July 2015.','0','0','2019-09-12 23:08:22','2019-11-02 18:25:47',29852791176.63,131841207161.38,0.00,0.00,-0.015692,0.053090,-0.170880,0.073987,-395.30461500),(1296,5031,3,'XRP','Ripple',0.29540,1.00,0.017545,1212344387.11000,1.00,12775632401.61,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/xrp.png','1',1,'https://ripple.com/','N/A','N/A','100000000000','XRP is the native digital asset of the Ripple platform. Ripple aims to connect banks and payment providers to provide a frictionless experience for sending and receiving money globally. It was originally designed as a day-to-day payment system, to speed up and reduce the costs of transactions, and provide a mediatory currency for exchanges and conversions with minimum commission. \n\n Software developer Ryan Fugger founded the original Ripple project in 2004. The core idea behind the protocol was a peer-to-peer trust network of financial relations that would replace banks. Based on the premise that money is simply a bank’s promise of value, he aimed to create a monetary system where the promise of an individual held just as much weight. His concept was launched in 2005 as RipplePay, a financial service allowing users to extend credit lines to friends and family and make secure payments in traditional and online currencies. \n\n In 2012, Jed McCaleb, an American programmer and entrepreneur, along with Chris Larsen, an angel investor and startup executive, approached Ryan with a digital currency idea. Jed had been working on a digital currency system in which transactions were verified by consensus among members of the network. After discussions, Ryan handed over the reins to Jed and Chris, who co-founded the corporation OpenCoin, to develop the Ripple protocol (RTXP) and the Ripple payment and exchange network. The company later changed its name to Ripple Labs. \n\n The Ripple platform is similar to Ethereum in that it has its a native currency (XRP) but is also open-source, allowing users to build their own assets and products on top of the existing platform. Ripple uses its proprietary patented technology, the ‘Ripple protocol consensus algorithm’ (RPCA), to verify transactions. It is argued that XRP is not technically a cryptocurrency because it is controlled by one company and transactions are processed by its network of approved validators. \n\n Ripple released its XRP token in January 2013. Like traditional cryptocurrencies, it is based on a public chain of cryptographic signatures. The company initially set the supply of XRP at 100 billion of which 80 billion tokens were allocated to the company and 20 billion were given to the three founders. On June 13, 2016, Ripple obtained a virtual currency license from the New York State Department of Financial Services, making it the fourth company with a BitLicense. \n\n XRP enhances Ripple’s software by acting as a bridge between traditional fiat currencies, providing liquidity and speeding up cross-border transactions; however, it is not essential to the network and doesn’t have to be used. \n\n RippleNet is what Ripple calls the network of financial institutions using its products. There are three core segments: xCurrent for processing payments, xRapid to source liquidity, and xVia to connect to the network and send payments.','0','0','2019-09-12 23:08:24','2019-11-02 18:25:47',4595453668.80,24451566633.71,0.00,0.00,-0.022973,0.193966,-0.072313,0.017937,1634.81572500),(1297,202330,4,'BCH','Bitcoin Cash',292.03243,1.00,0.059977,1573853119.62000,1.00,5283220885.14,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/bch.svg','1',1,'https://www.bitcoincash.org/','SHA-256','PoW','21000000','Bitcoin Cash (BCH) is a peer-to-peer electronic cash system. It’s a permissionless, decentralized cryptocurrency that requires no trusted third parties and no central bank. It was created in 2017 after the Bitcoin community split in two (or hard-forked) over scalability issues. The plan for a Bitcoin alternative was pushed through by Bitcoin activists, investors, entrepreneurs, developers, and largely China-based miners. It was considered to be one of the most successful hard-forks of the original Bitcoin. At the time of the fork, anyone owning Bitcoin was also given the same number of Bitcoin Cash units. \n\n Bitcoin Cash increases the size of blocks, allowing for more transactions to be processed. Because the blocks are larger and contain more information, more computational power is needed to process (or mine) them. \n\n The larger block sizes remove the need for Segregated Witness (SegWit), a code adjustment used by Bitcoin to free up block space by removing certain parts of the transaction. One issue the community had with SegWit was that it forced transactions to happen off-chain, breaking the economic incentives to make Bitcoin work. By using larger blocks and speeding up transaction process time it is hoped that Bitcoin Cash will remain on-chain and still be able to compete with the number of transactions established by financial platforms like Visa or Paypal. \n\n The Bitcoin Cash protocol ensures there will never be more than 21 million coins in existence. The platform states that no transaction is too big or too small and that their network is on 24-hours a day, 365 days a year. \n\n By the end of 2018, Bitcoin Cash boasted sub-cent transaction fees, it was accepted at around 670 physical locations around the world, which (it claimed) made it the most secure and widely used digital currency on the planet.','0','0','2019-09-12 23:08:27','2019-11-02 18:25:47',5877627061.25,27914647970.13,0.00,0.00,0.096182,0.315853,-0.128203,0.368017,8808.12874000),(1298,3808,5,'LTC','Litecoin',58.84161,1.00,0.017396,1684587756.63000,1.00,3741964528.21,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/ltc.svg','1',1,'https://litecoin.org/','Scrypt','PoW','84000000','Litecoin (LTC) (Ł) is a is a рееr-tо-рееr сrурtосurrеnсу аnd open ѕоurсе software project. It is very similar to Bitcoin but transactions are much faster. Litecoin users are also able to transfer with lower fees than they would if they made a traditional bank transfer. \n\n The crеаtіоn аnd transfer оf Litecoin іѕ bаѕеd on a ореn-source сrурtоgrарhіс рrоtосоl which іѕ nоt mаnаgеd bу аnу сеntrаl authority. Litecoin enables instant, near-zero cost payments to anyone in the world. \n\n The coin is designed for everyday use, pumping out four times as many coins as Bitcoin, in an effort to keep the digital currency from becoming scarce and too expensive. Transactions are also said to be four times faster. There is a limit of 84 million Litecoins. \n\n Litecoin was released on October 7, 2011, via an open-source client on GitHub, under MIT/X11 lісеnѕеѕ which are permissive forms of open software licenses with limited restrictions on reuse. The Litecoin Network went live on October 13, 2011, and is described as a fork of the Bitcoin Core client. In addition to trading and purchasing Litecoin, it is possible to mine it, which essentially means providing the network with computational power in exchange for the digital currency. As of 2018, miners were awarded 25 new Litecoins per block, an amount which will get halved roughly every 4 years (every 840,000 blocks). \n\n In May 2017, Litecoin became the first of the top 5 (by market cap) cryptocurrencies to adopt Segregated Witness (known as SegWit), which is a soft fork allowing optimal data transmission while bypassing certain protocol restrictions. This (amongst other things) not only speeds up transactions but allows for larger block sizes. \n\n The currency was created by Charlie Lee, a former Google employee and Engineering Director at Coinbase. Litecoin is his second attempt at a cryptocurrency, having launched one called Fairbrix which didn’t get off the ground due to technical problems. In 2017 Charlie sold or donated all of his Litecoins except for a few he kept as collectibles. He took the decision not to hold a significant amount of the tokens to avoid a conflict of interest. \n\n The Litecoin blockchain is the largest global scrypt based network, operating with 100% uptime since 2011 securing and transacting billions of dollars of value. Scrypt is an algorithm specifically designed to make it costly to perform large-scale custom hardware attacks by requiring large amounts of memory. \n\n Litecoin was created to make mining as accessible and democratized as possible, rather than being monopolized by companies with huge mining capabilities. Since the time between mining blocks is small, more miners have the opportunity to mine blocks and earn mining rewards. At the beginning of 2018, 14,400 Litecoins were being mined a day, the maximum number possible.','0','0','2019-09-12 23:08:29','2019-11-02 18:25:48',10555608813.70,43785912241.86,0.00,0.00,0.003450,0.043945,-0.366554,0.095246,-2254.27287500),(1299,171986,6,'USDT','Tether',1.00202,1.00,-0.000344,18131095652.31000,1.00,4116343074.69,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/usdt.svg','1',1,'https://tether.to/','N/A','N/A',' ','Tether (₮) (USD₮) is a cryptocurrency with digital tokens designed to replicate the value of the United States Dollar. The theory is that this provides protection from the volatility of cryptocurrencies, so 1 USD₮ will always be worth $1. To achieve this Tether claims to have each token backed 100% by actual assets in the platform’s reserve account. \n\n The origins of Tether came from a whitepaper published online in January 2012, in which software developer J.R. Willett described the possibility of building new currencies on top of the Bitcoin protocol. Credited with ‘inventing the ICO’ to fund the project, Willett went on to implement his idea in the form of the ‘Mastercoin’. The Mastercoin protocol became the technological foundation of the Tether platform. Tethers exist on blockchains using the Omni Protocol, and as ERC20 tokens. \n\n Two original members of the Mastercoin Foundation, Brock Pierce and Craig Sellars, became co-founders of Tether. Former child actor, Brock was a minor partner in a digital entertainment network that raised $88 million in venture capital in the 1990s. In 2013, he joined brothers Bart and Bradford Stephens in founding the venture capital firm Blockchain Capital (BCC) which was reported to have raised $85 million in two venture funds by October 2017. \n\n Co-founder Craig Sellars started his career as a UX developer, worked in various engineering positions before presiding over a number of wireless operations. His first foray into the blockchain space was at Tether, later becoming CTO of exchange Bitfinnex for a year and a half. Since then he has held a variety of roles as co-founder, technologist, facilitator, and advisor for several blockchain projects and companies including vAtomic, Unsung, Fuzo, Factom, Synereo, Tau Chain and the MaidSafe Foundation. He is the founder of the Omni Foundation which developed the protocol used by Tether. \n\n Reeve Collins, the third co-founder, launched several ventures before Tether, including Traffic Marketplace, one of the first online ad networks to be acquired by Vivendi Universal, RedLever, a branded entertainment studio, acquired by Adconion Media Group, and Pala Interactive, where he secured $70 million to create a legal, real-money gambling site in the US. \n\n Tether was incorporated in Hong Kong with offices in Switzerland. In January 2015, the cryptocurrency exchange Bitfinex enabled Tether trading on its platform. Bitfinex officials Philip Potter and Giancarlo Devasini were responsible for setting up Tether Holdings Limited in the British Virgin Islands in 2014. A spokesperson for Bitfinex and Tether stated that Jan Ludovicus van der Velde was also the CEO of both firms at the time.','0','0','2019-09-12 23:08:32','2019-11-02 18:25:48',85794388466.63,384420872405.21,0.00,0.00,0.001973,0.000439,0.000389,-0.000099,29.22299500),(1300,166503,7,'EOS','EOS',3.33508,1.00,0.010290,1549952827.60000,1.00,3129930767.97,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/eos.svg','1',1,'https://eos.io/','DPoS','DPoS',' ','EOS is the native cryptocurrency that powers the blockchain protocol EOSIO, a network, and platform for the deployment of decentralized applications built on Ethereum. Unofficially EOS stands for ‘Ethereum Operating System’. \n\n The protocol is a sidechain solution developed on top of the Ethereum network to overcome scalability issues. Sidechains allow developers to process transactions off-chain, only adding to the public ledger as needed, thereby avoiding the process bottlenecks. The smart contract platform claims to eliminate transaction fees and is capable of conducting millions of transactions per second. \n\n EOSIO was developed by the private company block.one, which is registered in the Cayman Islands. Its first whitepaper was published in 2017, and its open-source software was released on June 1, 2018. It aims to be the first decentralized operating system that provides a development environment for decentralized applications (dApps) like BitShares, a decentralized cryptocurrency exchange (DEX), and Steemit, a social network with monetary incentives. \n\n The EOS utility token is supported by wallets and exchanges that support the ERC-20 protocol (a series of functions and events that an Ethereum token contract has to implement). The blockchain platform’s constitution states that any EOSIO members who don’t use their EOS for three years could have their accounts terminated. Block.one says this measure is to encourage the platform to be used for its intended utility i.e. building dApps and communities by staking tokens for RAM, CPU, Network, and eventually storage. \n\n Block.one’s software uses a decentralized consensus algorithm called Delegated Proof of Stake (DPOS). It was created by block.one’s co-founder Dan Larimer as an improvement to Bitcoin’s ‘Proof of Work’ system. DPOS uses less electricity, is faster, and is less centralized. \n\n Dan was formerly a software engineer on America’s military-industrial complex working on defense projects such as drones and unmanned vehicles. After a crisis of conscience, he left to create systems that provide ‘life, liberty, and property for mankind.’ EOSIO is the third blockchain platform he has co-founded. Larimer developed the blockchain technology Graphene, and founded Steemit, a social network which uses blockchain technology to reward users. DPOS also has a number of applications and has been used in everything from Steem (the blockchain used by Steemit), EOS, List, Ark, and more. \n\n Fellow co-founder Brendan Blumer began his journey into virtual assets aged 14, selling characters, magic weapons, and houses in online games such as Everquest and World of Warcraft. His first company, Gamecliff, created when he was fresh out of college, was acquired by Internet Gaming Entertainment (IGE) in 2005. Two years later he founded The Accounts Network, a company that sold in-game MMORPG avatars. In 2010, Blumer further launched Okay.com, an enterprise data sharing platform for real estate brokers in Asia. \n\n In June 2017, EOSIO opened its initial coin offering (ICO), raising a record $4.1 billion in just one year making it the most successfully recorded ICO at the time. During this period, 1,000,000,000 EOS was distributed with 10% being withheld by block.one. \n\n In 2018 block.one announced a partnership with blockchain veterans Michael Cao and Winnie Liu to form a new $200 million joint venture fund, EOS Global. The fund will make strategic investments in Asia-focused projects that utilize EOSIO. \n\n In the same year, the company announced a number of other strategic partnerships including a $100 million joint venture fund with FINLAB AG, to support projects that stimulate EOSIO innovation in Europe. It also partnered with Galaxy Digital to deploy capital for future investments through it\'s $325 million EOSIO Ecosystem Fund and created a $50 million fund with TOMORROW BLOCKCHAIN OPPORTUNITIES.','0','0','2019-09-12 23:08:36','2019-11-02 18:25:48',10836582761.42,36936686479.44,0.00,0.00,0.019798,0.137809,-0.210202,0.164128,1653.79102500),(1301,204788,8,'BNB','Binance Coin',20.25003,1.00,0.016643,183281051.57000,1.00,3149623398.43,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/bnb.svg','1',1,'https://www.binance.com/en','N/A','N/A','187536713','Binance Coin (BNB) is a cryptocurrency issued by the popular trading platform Binance. The coin runs natively on the Ethereum blockchain and follows the ERC20 technical token standard. It is classified as a utility token and can be used on the Binance exchange. \n\n In July 2017, Binance held an Initial Coin Offering (ICO) for BNB which helped it to raise $15 million. During the ICO process, the company offered 10% of the total number of coins (BNB 20 million) to angel investors, 40% (BNB 80 million) to the founding team, and the remaining 50% (BNB 100 million) to other participants. Holders of the BNB coin are referred to as Binancians. \n\n According to Binance’s whitepaper, half the funds raised during the ICO were earmarked for branding and marketing, one-third were used to build the Binance platform and perform necessary upgrades to the Binance ecosystem, and 15% were kept in reserve for emergencies. \n\n The token was established with a total supply of 200 million, and a key influence on BNB’s value is Binance’s strategy to buy back a percentage of the coins and ‘burn’ them. Burning coins means taking them out of circulation and permanently destroying them. The benefit is that it increases the value of the remaining coins left in circulation. Binance has stated that it will use 20% of its profits from every quarter to buy back and burn BNB until the supply of the coin is 50% of the original amount (100 million BNB). Every buy-back transaction conducted by Binance is announced via the blockchain for transparency. \n\n The BNB token itself has multiple uses, essentially being the underlying gas that powers the Binance ecosystem. For the first year, Binance offered a 50% discount on its exchange trading fees using the coin. In its whitepaper, Binance has outlined plans to offer annually decreasing discounts on fees for BNB users until its fifth year of operation. \n\n There have been several other real-world use cases for BNB since its launch. In 2017 Monaco, which offers a Visa-branded credit card that converts cryptocurrencies into fiat payments, announced its plans to support BNB.  It can also be used on Uplive, Asia’s premier high-end live video platform. \n\n BNB has become more usable for goods and services in a growing number of brick and mortar establishments around the world. Australian startup TravelbyBit, for example, has equipped more than 150 establishments, including Brisbane Airport, with the ability to pay for goods and services using cryptocurrencies including BNB. \n\n The token is also being used as a payment method on platforms made by blockchain startups such as crypto point-of-sale solutions provider Pundi X, blockchain payments company Crypto.com, and CoinPayments, which acts as a crypto point of sale for millions of online vendors around the globe. Binance also states that about 9 in 10 of its employees receive a portion of their salaries in the BNB token.','0','0','2019-09-12 23:08:38','2019-11-02 18:25:48',1068962130.99,5261158563.89,0.00,0.00,0.072052,0.292765,-0.261898,0.116962,3055.41518000),(1302,5038,10,'XMR','Monero',62.67232,1.00,0.032908,150505692.35000,1.00,1083491257.54,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/xmr.svg','1',1,'https://www.getmonero.org/','CryptoNight-V7','PoW',' ','Monero (XMR) is a secure, private, and untraceable digital currency. Although it offers the option of transparency, it is typically known for its use of privacy technologies such as ring signatures, ring confidential transactions, and stealth addresses to obscure the origins, amounts, and destinations of transactions. \n\n You can buy Monero from an exchange or from an individual. Alternatively, you can mine Monero to get coins from the block reward. Monero is based on the CryptoNote protocol. Unlike Bitcoin, where people can see exactly how much money is being sent from one user to another, Monero hides this information to protect user privacy. Monero also features a dynamic block size and dynamic fees, an ASIC-resistant proof of work, and a tail coin emission. \n\n Monero’s Kovori is an anonymized router which integrates I2P technology and has been under development since 2015. The project will improve the privacy of the network by hiding the IP addresses of those who wish to interact with the Monero blockchain. \n\n Due to the stringent privacy features, Monero experienced rapid market capitalization growth in 2016, far surpassing that of other cryptocurrencies. This was reportedly due to its adoption by the darknet market and rightwing extremists. \n\n Monero is an open source project maintained by a group of core developers and a community of open source contributors and researchers. There are no public details about the founders in the public space; the first whitepaper with a focus on the CryptoNote protocol was written by Nicolas van Saberhagen (assumed to be a pseudonym). In 2018, it was widely reported in the crypto press that Monero had 7 members, 49 developers, and 3 researchers, with the unofficial figurehead of ‘pseudonymous Luigi’. \n\n In 2017, there was some controversy about a Javascript mining software called Coinhive which generates a script allowing websites or apps to access a visitor\'s Central Processing Unit and mine Monero. The site or app owner gets a percentage of the coins mined while visitors are consuming content on their site. Coinhive did not require the third-parties to tell visitors that their computers were being accessed and their electricity consumed in exchange for a site visit. \n\n Monero suffered another PR issue in 2018 when hackers took advantage of weak code to manipulate the amount of XMR shown in a wallet, before convincing exchanges to pay out. \n\n A team of researchers from a broad collection of institutions, including Princeton, Carnegie Mellon, Boston University, MIT, and the University of Illinois at Urbana-Champaign, also claim that a token’s movements on Monero are not as obscured as they seem and that it is possible to extract information on individual transactions.','0','0','2019-09-12 23:08:41','2019-11-02 18:25:48',337262498.66,2196928899.00,0.00,0.00,0.027058,0.113911,-0.287454,0.159056,766.08115000),(1303,321992,11,'ADA','Cardano',0.04230,1.00,0.016389,32958690.02000,1.00,1096757663.60,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/ada.svg','1',1,'https://www.cardano.org/en/home/','Ouroboros','PoS','45000000000','Launched in 2017, Cardano is a decentralized public blockchain and cryptocurrency project which is fully open source and was built to support the creation of decentralized financial applications (dApps). It claims to have more advanced features than any protocol developed and to have the first currency to evolve out of scientific philosophy, academic theory, and peer-reviewed research. Appropriately, the platform takes its name from Gerolamo Cardano, an Italian polymath who is regarded as one of the greatest mathematicians of the Renaissance. \n\n The native cryptocurrency of Cardano is called Ada (ADA), named after Ada Lovelace, a 19th-century mathematician (and daughter of Lord Byron) who is often referred to as the first computer programmer. The currency is integrated natively into Cardano’s settlement layer, making it an essential part of the platform; however, this is something that Cardano reportedly intends to supersede. \n\n Ada enables users to send value over the internet securely and quickly. After launch, Ada had one official wallet called Daedalus. The circulating supply of Ada was 25 billion in 2018, with a maximum potential supply of 45 billion. Unlike most cryptocurrencies, Ada offers the ability to stake coins (essentially earn interest on holdings); however, due to the limited number of coins, the block reward is expected to drop over time. \n\n Cardano is spearheaded by three entities, each of which is separately owned and managed. The first is the non-profit Cardano Foundation, an independent body based in Switzerland with core responsibilities to help supervise the development of Cardano and its ecosystem. The second entity is Input Output HK (IOHK) which is contracted to design and build Cardano. The third is Emurgo, a Japanese incubator acting as the for-profit arm working to boost the Cardano ecosystem through commercial ventures. \n\n Rather than stemming from a whitepaper, Cardano is the result of a number of academic papers. The goal being that considerable peer review efforts via academic partnerships will ensure that Cardano is built and operated using qualitative ‘high assurance code.’ Cardano is being developed using Haskell, a programming language unique to the platform, featuring a high degree of fault tolerance. Smart contracts are created in another functional language called Plutus which enables stricter contracts. \n\n Like Ethereum, Cardano is a smart contract platform. It features a unique consensus algorithm (called Ouroboros) that validates transactions without high energy costs, aiming to dramatically increase transactions per second while boosting computational power. The platform is considered ‘third-generation’ and is intended to improve on second-generation platforms like Ethereum and first-generation platforms like Bitcoin. This is partly achieved by employing the ‘Ouroboros proof-of-stake’ model rather than a proof-of-work model. \n\n Both Ethereum and Cardano (or IOHK, the entity that designs and builds Cardano) were co-founded by Charles Hoskinson. Charles is a Colorado-based technology entrepreneur and mathematician who also founded a third cryptocurrency-related start-up – Invictus Innovations. \n\n IOHK’s second founder, Jeremy Wood, was formerly Manager of Operations at Ethereum, which he left to consult various entities on cryptocurrencies before co-founding Input Output. \n\n A key focus of Cardano is to use its coin and technology to provide assistance in countries with an acute lack of access to banking. Cardano has explicitly stated that its currency’s ultimate value will be based upon hard work, real-world use, and the utility of the platform, not on making day traders rich.','0','0','2019-09-12 23:08:44','2019-11-02 18:25:48',303525429.95,1971746472.50,0.00,0.00,-0.001583,0.101906,0.000000,0.086646,2474.63027500),(1304,4614,12,'XLM','Stellar',0.07026,1.00,0.022378,200556590.07000,1.00,1408955863.88,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/xlm.svg','1',1,'https://www.stellar.org/','N/A','N/A',' ','Stellar is a platform that connects banks, payments systems and people, helping them to move money across borders at almost no cost. It acts as a bridge facilitating the low-cost trading of fiat currencies, particularly in cases where there might not be a large direct market. \n\n The native asset of the Stellar network is the Lumen (XLM). Lumens are used to pay transaction fees on the platform and act as a security measure that mitigates DoS attacks that attempt to generate large numbers of transactions or consume large amounts of space in the ledger. The asset also plays an anti-spam role, as all user accounts must hold a minimum of 0.5 Lumen, discouraging abandoned accounts and ensuring that they all have economic utility. \n\n In 2014, when the network launched, the native asset was also called ‘Stellar’ but was renamed ‘Lumen’ in 2015 to prevent confusion. The supply of Lumens is governed by strict protocol-level rules. At launch 100 billion were created and every year new Lumens are added to the network at an inflation rate of 1%. \n\n The platform and development of the network are run by the Stellar Development Foundation, a non-profit and non-stock fund. The founders of the fund can neither benefit from its operation or from the sale of its shares. \n\n After launch, the foundation announced its intentions to distribute 50% of the total number of Lumens to each unique individual who signed up through an invitation. Partners such as businesses, governments, institutions, or nonprofit organizations that contribute to the growth and adoption of the Stellar ecosystem were allocated 25%. A further 20% was given away to Bitcoin and XRP holders over two distribution rounds in 2017, and 5% is reserved for operational expenses. As of January 2018, 8 billion Lumens had been given away. \n\n Stellar is an open-source, distributed payments infrastructure, meaning that anyone can build an app or financial product on top of it. It was developed to provide the opportunity for new organizations to extend financial access to unserved communities by ensuring participants record transactions correctly. IBM’s blockchain division, for example, partnered with Stellar in 2017 and use Lumens as a unit of account for their banking payments infrastructure. \n\n Like all blockchain platforms, Stellar consists of a number of servers (or nodes) around the world which keep a record of every account and transaction in the network and store the records in a ledger. The properties of the ledger can only be changed when all servers reach a consensus that the change meets the protocol criteria. \n\n The company was founded by Jed McCaleb and Joyce Kim. Jed is an American programmer and entrepreneur who founded and served as the CTO of Ripple until 2013 and is known for creating the Bitcoin exchange Mt. Gox. In January 2018, McCaleb\'s Ripple token ownership was reported to be worth $20 billion, putting him in 40th place in Forbes\' list of world\'s richest people. \n\n After beginning her career as an attorney, Joyce was a venture capitalist at Freestyle Capital. She co-founded SimpleHoney, a mobile commerce startup, and was CEO of Soompi, an English language website providing coverage of Korean pop culture. She resigned as Executive Director of Stellar in 2016. \n\n Stellar was based on the initial Ripple protocol and model. After systemic problems with Ripple’s existing consensus algorithm were discovered, Stellar created an updated version of the protocol with a new consensus algorithm. Both platforms have many common traits, however Stellar is known to be more opensource and decentralized.','0','0','2019-09-12 23:08:47','2019-11-02 18:25:48',214201254.96,1010342097.01,0.00,0.00,0.066155,0.198719,-0.142600,0.120092,3330.16581000),(1305,310829,15,'TRX','TRON',0.02007,1.00,0.028455,303518487.55000,1.00,1338229750.11,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/trx.svg','1',1,'https://tron.network/','N/A','DPoS',' ','Tronix (TRX) is the native currency of the Tron blockchain platform. The platform was designed to form the foundation of a decentralized entertainment ecosystem. This will allow content creators to connect directly with consumers, cutting out middlemen and removing the barriers to independent producers seeking distribution channels. It claims users will benefit from the data they create, unlike traditional social platforms that harvest your data and monetize it. \n\n Founded by a Singapore-based non-profit, the Tron Foundation not only aims to capitalize on the global entertainment industry, but, according to its whitepaper, sees its protocol as an enabler for live social broadcasting, gambling applications, gaming, and social or dating interactions. \n\n Tronix can be used by content consumers to pay for the content they want to access on the Tron network. These coins then go to the content producers’ accounts, where they can be exchanged to other cryptocurrencies, or used to pay for blockchain services. At launch, TRX was an ERC-20 token on the Ethereum mainnet; in June 2018, when the Tron mainnet launched, the ERC-20 tokens were migrated to the native TRX coin (TRON20) at a 1:1 ratio. This event is referred to as the Tron Independence Day. \n\n An apparent benefit of the TRX is its speed. The website states that TRX consistently handles 2,000 transactions per second (TPS), 24/7 compared to 25 TPS for Ether and 3-6 TPS for Bitcoin. Another benefit is that Tron removes the complication of building a new blockchain protocol from scratch by providing one on which developers can create and deploy their own decentralized applications (dApps). \n\n Tron’s mainnet aims to ‘heal the internet’ through free and uncontrolled data, a content ecosystem where users can obtain digital assets from content spreading, a personal ICO feature with the ability to distribute digital assets, the infrastructure to allow distributed digital assets exchanges (such as games), and market forecasting. \n\n In 2019, Tron had dual headquarters in Beijing and San Francisco, and was planning to establish more overseas offices in preparation for rapid expansion. Its founder, Justin Sun, worked for two years as the chief representative and advisor to Ripple in greater China, helping it with its first successful round of funding. He also the founded PEIWO, a mobile social networking and voice streaming app. \n\n As of January 2019, around 98% of the 100 billion circulating supply of ERC-20 TRX had been burnt (destroyed) by the Tron foundation and its community. The burn only applied to the ERC-20 tokens, which are said to be ‘old and useless’ and not the newer Tron coins that are native to the Tron mainnet.','0','0','2019-09-12 23:08:50','2019-11-02 18:25:48',1515864465.74,5636062334.13,0.00,0.00,0.123670,0.404120,-0.100457,0.297104,9281.09193000),(1306,3807,16,'DASH','Dash',72.00464,1.00,0.006963,125591090.56000,1.00,657617677.11,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/dash.svg','1',1,'https://www.dash.org/','X11','PoW/PoS','18900000','Dash (DASH) is a cryptocurrency created and designed to guarantee privacy. Launched in 2014, it was originally released as XCoin (XCO) before changing its name to ‘Darkcoin’. It was one of the first digital currencies to feature a decentralized blockchain governance system. It rebranded again in March 2015; its new name is an amalgamation of the words ‘digital cash’. \n\n The coin was created as a result of a Bitcoin fork in an attempt to improve on efficiency, speed, and anonymity. It is designed to be user-friendly and accessible, claiming to be the perfect option for people who are not interested in cryptocurrency. Transactions have low fees and are much faster than Bitcoin. \n\n Dash coins are obtainable through mining, running the network as a masternode, or by exchanging them for other tokens and fiat currencies. Anyone can form a masternode if they hold 1000 Dash in collateral. If a miner is willing to perform advanced functions (such as increased privacy and instant transactions) they can earn a 45% block reward. In April 2018, Dash\'s market capitalization was around $4.3 billion, it was one of the top 12 cryptocurrencies and its peer-to-peer network was one of the largest in the world. \n\n The founder of Dash is crypto developer Evan Duffield who began to work in programming when he was still in high school. He has held positions at a number of tech firms including Warped AI, iAcquire, Wells Fargo, and Verizon Wireless. Evan became enthralled with crypto after reading Satoshi Nakamoto’s whitepaper. When he realized the future importance of fintech, he went on to gain a series 65 license allowing him to become an investment advisor in the US. \n\n Dash is designed to have a total supply of 18 million coins with the circulating supply of Dash in 2018 hovering at around 7.4 million. The coin is set to reach its supply limit in the year 2300. Dash has a variable block reward which decreases at a 7.1 % rate each year. The average block mining time is 2.5 minutes on the Dash blockchain, which makes it four times faster than Bitcoin. \n\n Using a coin mixing service called CoinJoin, Dash allows you to send your funds privately by mixing it between several other transactions, making it harder to identify the specifics. For a slightly higher processing fee, it offers ‘Instant Send’ transactions (processed within 1.5 seconds). \n\n Dash also offers a shares scheme where users can allocate their coins to help incentivize masternodes, while receiving up to 8% of interest a year. This compares to traditional banks which offer around 0.8% return. \n\n Dash is listed on a large number of exchanges and it possible to exchange it for goods and services at a number of online organizations including online casinos, marketing agencies, and coffee merchants. Most sellers are based in the US and Europe. Over 2018 and at the beginning of 2019, Dash became extremely popular in Venezuela where the hyperinflation of the local currency had left locals unable to afford basic items or food.','0','0','2019-09-12 23:08:53','2019-11-02 18:25:48',1163709435.77,5582087116.96,0.00,0.00,-0.000711,0.037077,-0.323606,0.066949,-2368.48465000),(1307,5324,17,'ETC','Ethereum Classic',4.98828,1.00,0.026763,372505906.90000,1.00,572465835.12,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/etc.svg','1',1,'https://ethereumclassic.org/','Ethash','PoW','210000000','Ethereum Classic (ETC) is a second generation blockchain, a network, a community, and a cryptocurrency. In addition to allowing people to send amounts of value to each other, ETC allows for complex contracts that operate autonomously and cannot be modified or censored. \n\n Both Ethereum Classic and Ethereum (ETH) have a value token called ‘Ether’, which can be transferred between participants, stored in a cryptocurrency wallet, and used to compensate participant nodes for computations performed on the Ethereum Platform. \n\n The Ethereum concept was initially described in a white paper by Vitalik Buterin, a Russian-Canadian programmer in late 2013. Development was funded by an online crowdsale that took place between July and August 2014, with the Ethereum system going live on 30 July 2015. \n\n Two years after Ethereum’s launch there was a hack which caused a split in the community, often described as a ‘battle of ethics and ideology’. The victims were investors in a fund called the DAO (Decentralized Autonomous Organization), which was launched by the Ethereum community as a decentralized investment fund for smart contract projects. \n\n Instead of a few venture capitalist partners making decisions on which projects to invest in, DAO holders were promised a voting input in investments. The project was so popular that the ICO attracted over $150 million in funding. \n\n In June, 3.6 million Ether (worth approximately $50 million USD) was taken from accounts in the DAO and moved to another account without the owners\' consent, exploiting one of several vulnerabilities that had already been flagged by community members. A loophole in the code allowed someone to repeat a refund request multiple times for the same DAO tokens before the transaction could be registered on the system. The recursive function was able to run until a third of DAO’s funds were siphoned off. \n\n Ironically the stolen currency can never be spent because the code in the blockchain would allow them to be traced. Following the hack, there was a majority decision that Ethereum needed to fork and create something new from scratch. \n\n The new protocol retained the original name Ethereum (ETH) because of the amount of community support for the fork. It functions on a brand new blockchain, and the vast majority of miners, users, and protocol from the previous version of Ethereum use this new version. In this sense, Ethereum functions more like a software company. ETH’s primary value is in its use case scenarios and community support. The Ethereum Alliance, for example, consists of billion-dollar firms such as Accenture, JP Morgan, Microsoft, and UBS. The Ethereum chain that forked (ETH) was able to retrieve the $50 million that was hacked and return it to investors. \n\n Ethereum Classic (ETC) has a new name but is the original version of the Ethereum protocol using the original blockchain. Only 10% of the community was in favor of keeping it, but it is said to still retain value because of the speculative nature of the crypto market.','0','0','2019-09-12 23:08:55','2019-11-02 18:25:48',3084833800.13,16857250254.37,0.00,0.00,0.027916,0.082501,-0.182087,0.130701,1186.50824500),(1308,166390,18,'XTZ','Tezos',0.86811,1.00,0.000969,2433102.00000,1.00,573277184.12,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/xtz.svg','1',1,'https://tezos.com/','N/A','DPoS',' ','Tezos is a smart contract platform with an on-chain governance model. It claims to be the world’s first self-evolving blockchain and its main premise is the ability to integrate new technology into the ledger as it becomes available. Its native utility token XTZ (known as Tez or Tezzies) launched on June 24, 2017, at a price of approximately $3 per coin. \n\n Self-amendment allows Tezos to upgrade itself without having to split or fork the network into two different blockchains. This avoids divisions in the community that can disrupt the network, reduces execution costs for upgrades, and allows future innovation to be seamlessly implemented. \n\n The Tezos blockchain protocol is a delegated proof-of-stake (PoS) system that supports Turing complete smart contracts. It is implemented in OCaml, a functional programming language that offers speed, an unambiguous syntax and semantics, and formal proofs of correctness. \n\n Tezos allows all stakeholders to participate in the on-chain governance of the protocol through an election cycle, which provides a formal and systematic procedure to reach agreements on amendments. Upgrades to Tezos are staged through a testing environment to allow stakeholders to recall potentially problematic updates should they arise. Tezos developers can propose protocol upgrades in exchange for contribution rewards. \n\n The PoS system means that all validations are conducted virtually, not physically, and does not require mining hardware and large amounts of electricity; the process is called ‘baking’ as opposed to ‘mining.’ You can acquire XTZ through the ‘baking’ model by signing and appending a block of transactions to the Tezos blockchain. \n\n There are two types of accounts that exist on the Tezos blockchain: originated accounts and implicit accounts. Originated accounts can’t take part in the baking process, and must instead assign a delegate (with an implicit account) to bake on their behalf. Implicit accounts can participate in the Tezos baking process, as long as the account has been registered as a delegate. \n\n XTZ holders of both kinds of accounts can participate in the consensus mechanisms that keep the chain functioning and receive rewards for doing so through the ‘delegating’ process. A standard unit of Tezos for baking is a roll of 10,000 coins. A baker stands a higher chance of being able to bake or endorse a block if they have a larger number of rolls. An originated account holder who delegates coins to a baker receives an annualized yield (like interest). \n\n The project is the vision of Arthur Breitman, a French-born mathematician and computer scientist with a background working for large corporates like Morgan Stanley and Goldman Sachs. The project’s co-founder and Breitman’s wife, Kathleen, has previous experience in the financial sector, having previously worked for renowned companies such as Bridgewater Associates and R3. \n\n After failing to raise funds from banks and investors through the USA registered company Dynamic Ledger Solution, Inc. (DLS), the Breitmans raised funds through an ICO in July 2017. It was an unprecedented success, raising 66,000 Bitcoin and 361,000 Ether (equal at the time to $232 million) in the space of only 13 days. \n\n This fundraising was soon followed by several controversies, including internal board member disputes and several class-action lawsuits. The Tezos foundation, however, went on to successfully launch its beta network in 2018. The first exchanges to list XTZ for trade were Gate.io and HitBTC, where it quickly became a popular coin. \n\n In 2018, Tezos announced funding for TezTech, a Tezos-focused software shop with several projects underway, including a trustless scaling and custody solution, and API and software libraries.','0','0','2019-09-12 23:08:58','2019-11-02 18:25:48',21747904.64,111565423.25,0.00,0.00,0.003977,-0.068974,-0.393765,-0.009454,-5413.31017000),(1309,27368,20,'NEO','NEO',11.12150,1.00,0.051845,422364472.70000,1.00,784497260.23,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/neo.svg','1',1,'https://neo.org/','N/A','N/A','100000000','NEO is a non-profit community driven blockchain platform designed to create a scalable network of decentralized applications (dApps). Sometimes dubbed the Chinese Ethereum, it was originally launched in 2014, under the brand name of Antshares. Its dual-layered blockchain was developed by Onchain DNA, with a protocol that is said to fix many of Ethereum’s scalability issues. It rebranded as NEO in 2017. \n\n A self-proclaimed ‘smart economy’, NEO uses blockchain technology and digital identity to digitize assets and automate their management through smart contracts; contracts are developer friendly and use mainstream programming languages, such as C#, Python, Go, and Javascript. \n\n NEO and GAS (or neoGAS) are the two proprietary tokens used on the platform. NEO is the shares token, while GAS is the fuel token; the total supply of both is 100 million. Every NEO token gives the holder the right to manage the network and vote in discussions regarding bookkeeping and NEO network parameter changes. NEO cannot be mined, because it represents a share of the NEO market it is technically classed as a security. The minimum unit of NEO is one, and tokens cannot be subdivided. \n\n GAS is used to pay for NEO blockchain service fees such as the storage of tokens and smart contracts. To register or change assets on the blockchain, you need to acquire GAS. It acts as an economic incentive for bookkeepers and prevents the abuse of resources. GAS can be traded on exchanges and has a minimum unit of 0.00000001. NEO holders earn GAS when there are new registrations and changes in assets, rather than profiting through transaction fees (which are currently set at zero). This strengthens the eco-system by encouraging NEO holders to focus on getting more people to join the blockchain. \n\n In April 2016, the NEO released a whitepaper on a new type of consensus protocol (dBFT – delegated Byzantine Fault Tolerance), which was the first to come from China. The protocol allows NEO to maintain a transaction speed of 1,000 transactions per second (TPS), compared to Ethereum’s 15 TPS. \n\n NEO held its ICO between July 1-9, 2016. Half of all NEOs (50,000,000) were sold at $0.036 each, while the other half was withheld by the NEO Council. Of the withheld amount, 10 million NEOs were allocated to core developers, 10 million were allocated to spark further development, 15 million were retained as a contingency, and 15 million were earmarked to be cross invested in NEO’s blockchain ecosystem. \n\n NEO and Onchain were founded by Da Hongfei and Erik Zhang, who are both notable figures in the Chinese blockchain industry. In 2016, Onchain was voted KPMG’s ‘Top 50 Fintech Companies in China’ and announced a partnership with Alibaba for a blockchain powered enterprise email evidence repository.','0','0','2019-09-12 23:09:01','2019-11-02 18:25:48',1143718729.40,5520539154.68,0.00,0.00,0.351618,0.512409,-0.066531,0.571421,17518.02111500),(1310,309621,22,'LINK','ChainLink',2.70741,1.00,0.010254,53944080.64000,1.00,947591879.67,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/link.svg','1',1,'','N/A','N/A',' ','Link (LINK) is a cryptoasset that powers the Chainlink decentralized oracle network.  This network allows smart contracts on the Ethereum platform to securely connect to external data sources, payment systems, and application program interfaces (APIs) that exist outside the blockchain.\n\nAlthough smart contracts (agreements between two parties written in computer code) have tremendous potential, the underlying consensus mechanisms of blockchain technology make it so smart contracts are unable to communicate with external data systems.  Some smart contracts can’t execute without off-chain information (e.g., a price fluctuation for a specific asset).  To solve this issue, oracles are used.\n\nAn oracle finds and verifies real-world events and submits this data to smart contracts on the blockchain.  Although oracles help, they also present another point of concern: oracles are centralized third-party sources.  A user must trust that the oracle is providing accurate data.  This is called the “oracle problem.”\n\nSmartContract (a San Francisco based fintech company) launched Chainlink in June of 2017 in response to the “oracle problem.” Originally called SmartContract Oracle, Chainlink is a blockchain middleware that connects smart contracts across blockchains and allows them to access off-chain information from multiple oracles in the network. \n\nInstead of relying on a single oracle to provide smart contracts with external data, Chainlink’s decentralized network of independent nodes can perform computations to determine the accuracy of off-chain data from several oracles before it is passed to a smart contract.\n\nThe ChainLink network uses Link, an ERC-20 token, as an incentive for Node operators to retrieve data from off-chain data feeds, structure data into readable formats on the blockchain, execute off-chain computation, and maintain uptime guarantees. \n\nSmartContract was cofounded in 2014 by Sergey Nazarov (CEO).  Before starting SmartContract, Sergey founded Secure Asset Exchange and CryptoMail. \n\nChainLink’s ICO was held in September of 2017 and raised $32 million USD. \n\nChainlink launched on Ethereum’s mainnet on May 30, 2019. \n\nAccording to SmartContract, Chainlink has partnerships with Google Cloud, Oracle, and SWIFT.','0','0','2019-09-12 23:09:05','2019-11-02 18:25:48',228444731.97,1305626978.56,0.00,0.00,-0.032171,0.390398,0.077351,0.148709,7148.97212500),(1311,41192,24,'MKR','Maker',523.98458,1.00,-0.000908,3656190.48000,1.00,523984579.27,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/mkr.png','1',1,'https://makerdao.com/en/','N/A','N/A',' ','Maker (MKR) is a proprietary utility token for the Maker platform operated by MakerDAO. It forms the basis of a blockchain-based banking system that simplifies international payments and peer-to-peer transfers. The main purpose of MKR is to govern the Maker Platform and to maintain the stability of the Dai stablecoin (DAI) through a ‘collateralized debt position’ (CDP) contract. \n\n DAI is a cryptocurrency that is suitable for payments, savings, or collateral. Its value is stable relative to the US Dollar (USD) but is collateral-backed by Ethereum rather than a fiat currency; DAI is an Ethereum ERC20 token and  every DAI is worth $1. The coin is soft-pegged to the USD and can be moved to another currency should the US economy collapse. \n\n DAI was developed as a solution to the volatility of popular digital assets like Bitcoin and Ether (ETH), which MakerDAO claims are impossible to use as everyday currencies due to their massive price fluctuations. Through smart contracts and MKR, the platform uses interest rate mechanisms to stabilize DAI’s price. \n\n DAI is created through borrowing against collateral on the Maker platform. To acquire DAI you need to leverage some of your ETH and lock it up as collateral in a CDP contract. At any time you can reclaim that collateral by returning the borrowed DAI plus an accumulated fee. \n\n Maker supports DAI’s stability directly by liquidating CDPs if the price of DAI’s underlying collateral (ETH) falls too far. This process is carried out by keepers; that is, traders that use programs to scan the blockchain for risky CDP’s. When a CDP is liquidated, the keeper receives a small reward for triggering the liquidation process; any excess proceeds are returned to the original borrower. \n\n MKR is a token that has governance rights over the Maker smart contracts. For instance, the collateralization rate of CDPs is set by a vote of MKR holders. In return for regulating the system, MKR holders are rewarded with fees. They also function as the buyer of last resort. Should the collateral in the system not be enough to cover the amount of DAI in existence, MKR is created and sold on the open market to raise the additional collateral. \n\n MKR’s value is volatile and based on the concept that it is the only token that can be used to pay the fees for creating a CDP to generate DAI. As of 2018, there were approximately 530,000 MKR in circulation out of a total supply of 1 billion. Whenever they are used to pay fees, the MKR gets consumed and destroyed. The more MKR is ‘burned’, the more its value will increase while less of it is required to perform transactions. At launch, there was a total token supply of 1,000,000 MKR. \n\n The company was co-founded by Rune Christensen, who studied International Business from the Copenhagen Business School. He also a founder of Try China, an international recruiting company. In 2019 it was reported that MakerDAO had raised $27 million over two previous funding rounds.','0','0','2019-09-12 23:09:08','2019-11-02 18:25:49',79295350.62,218023720.59,0.00,0.00,-0.053670,0.193959,-0.099837,0.065108,1311.90238000),(1313,808414,28,'ONT','Ontology',0.92355,1.00,0.075953,117712184.14000,1.00,517048171.16,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/ont.svg','1',1,'','VBFT','PoS',' ','Ontology (ONT) describes itself as a “high-performance public multi-chain project and a distributed trust collaboration platform.”  Ontology was created to help businesses adopt blockchain technology and compete with projects like Tron and VeChain Thor.  Ontology offers several distributed services including data exchange, data collaboration, digital identity authentication, blockchain creation, smart contracts, security protocols, and software development kits (SDK) among others.\n\nOntology was created in 2017 by the Shanghai-based company called OnChain, which is led by co-founders Erik Zhang, Jun Li, and Da HongFei.  Before creating Ontology, OnChain founded the NEO blockchain (formerly called Antshares) in 2014.  At the time of this writing, NEO is a top 20 cryptoasset ranked by market cap.\n\nOntology started off as a NEP-5 token on the NEO blockchain (which is comparable to an ERC-20 token on the Ethereum blockchain) but moved to its own blockchain in June of 2018.  Despite sharing the same parent company, Ontology and NEO are independent projects with different goals.  That said, the two projects have collaborated on building and promoting a NEO smart contract ecosystem.\n\nOntology employs a dual token system that consists of the ONT staking token and the ONG utility token.  ONT is used to stake and secure the blockchain while ONG is used to pay for token transactions, network storage, and the execution of smart contracts.  ONT tokens release ONG tokens which means ONT token holders will periodically receive ONG tokens.\n\nOntology’s consensus mechanism is called VBFT, which combines three different consensus protocols: proof-of-stake (PoS), Byzantine Fault Tolerant (BFT), and Verifiable Random Function (VRF).  Users who wish to stake ONT are required to set up a node on the Ontology platform.  In return for staking their ONT tokens, stakers receive a portion of network, storage, and smart contract execution fees.  ONT holders are able to vote on major upgrades and proposals for the Ontology network.\n\nInstead of an ICO, in March 2018, Ontology gave away ONT tokens to their email newsletter subscribers and airdropped ONT tokens to NEO token holders.  In the end, 20 million ONT tokens were distributed to the community.\n\nThe max supply of ONT is 1 billion.  Each ONT token is indivisible and all were mined in the genesis block.  The max supply of ONG is 1 billion as well and is divisible to nine decimal points.','0','0','2019-09-12 23:09:14','2019-11-02 18:25:49',354192882.06,1434992035.01,0.00,0.00,0.463864,0.516084,-0.037000,0.569748,19561.12086000),(1314,5285,29,'XEM','NEM',0.04225,1.00,0.027786,28391135.25000,1.00,380245685.41,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/xem.svg','1',1,'https://nem.io/','N/A','PoI',' ','NEM is a dual-layer blockchain similar to Ethereum but written in Java, a popular programming language; its native cryptocurrency is XEM. The platform describes itself as a ‘smart asset blockchain’ which allows developers to build a number of decentralized applications (dApps) for fintech, logistics, Initial Coin Offerings (ICO), and peer-to-peer payments. \n\n NEM stands for New Economy Movement, the premise of the platform is that it combines learnings from other cryptos (such as Bitcoin) with academic research in network theory. Its key advantage is its modular Smart Asset System, which enables businesses to replicate almost any business transaction on the blockchain with minimal development. Because NEM was created using Java, most programs can be easily adapted to utilize the network. It is sometimes described as a blockchain-based cloud platform. \n\n The founding vision of the protocol was to create a system that would give power to users, rather than coin hoarders and mining companies. One of the issues with the Proof of Work system used by Bitcoin (and many others) is that in order to mine tokens, you must use computational power; the greater your machine’s power, the greater the chance of earning coins. \n\n This has lead to a system where only those who can afford the latest and most expensive mining machines are able to profit, while the average person is not able to compete or contribute. Miners of larger amounts also have a tendency to hoard their coins without contributing to the system and if the amount they hold is large enough, they can gain control of the token network. \n\n To ensure a fairer system XEM cannot be mined or staked. Instead, the currency is harvested through the Proof of Importance (POI) algorithm and uses Delegated Harvesting to determine who can vest the next block. NEM’s POI system takes into account how much XEM a participant holds and whether they have actively helped the economy by transacting with others. Each user is given a trust score, the higher it is, the more chance they have of being rewarded. \n\n To begin vesting coins, a participant must place at least 10,000 unvested XEM coins in an approved XEM wallet. Over time, XEM coins pay out dividends (interest) and trust scores increase, as long as there is a balanced transaction history and the holder contributes to the community. \n\n There are 8,999,999,999 XEM in total, 75% of the coins were issued evenly to nearly 3,000 stakeholders after the launch of the genesis block on March 31, 2015. The remaining 25% of XEM was allocated to marketing and development expenses. The equal distribution is to ensure that no one can control the price or gain an advantage over others since each stakeholder only controls about 0.025% of the currency. \n\n The initial framework of NEM was laid out by an anonymous Bitcoin Talk forum user called UtopianFuture in 2014. By July 2018 the organization had grown to include the NEM Foundation and headquarters in Kuala Lumpur, Malaysia, which serve as an incubator, accelerator, co-working space.','0','0','2019-09-12 23:09:16','2019-11-02 18:25:49',139068832.95,847613798.75,0.00,0.00,-0.002635,0.063130,-0.335595,0.046293,-2236.51686000),(1315,24854,31,'ZEC','Zcash',37.77077,1.00,0.007530,92629874.05000,1.00,293256271.42,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/zec.svg','1',1,'https://z.cash/','Equihash','PoW','21000000','Zcash (ZEC or ⓩ), also known as Zerocash, is a decentralized digital currency with privacy at its core. The asset comes in two forms: shielded and transparent. Although transaction data is posted to the blockchain like Bitcoin, a shielded protocol allows transactions to be verified without revealing the sender, receiver, or transaction amount. The zero-knowledge proof constructions leveraged by Zcash are called zk-SNARKs (which stands for Zero-Knowledge Succinct Non-interactive Arguments of Knowledge). \n\n Zcash includes selective disclosure features which allow users to reveal a degree of transaction information for compliance or audit purposes. It is also possible to execute completely transparent transactions to accommodate wallets and exchanges that do not support the privacy features. \n\n According to the website, the platform was built by top cryptographers based on the research of scientists from MIT, Technion, Johns Hopkins, Tel Aviv University, and UC Berkeley. It was founded by Zooko Wilcox (born Bryce Wilcox) who also founded the Zerocoin Electric Coin Company, and created the Zerocoin protocol between 2013 and 2014. Zcash operates at the bleeding-edge of cryptography, requiring and producing novel research which is then freely shared with the rest of the ecosystem, including competitors. \n\n Released in October 2016, ZEC is similar to Bitcoin in that it has a fixed total supply of 21 million units and its mining reward is cut in half roughly every four years. Initially, 50 ZEC is created every ten minutes. Of the newly created ZEC 80% goes to the miners, and 20% to founders, employees, and investors - dubbed ‘the founder\'s reward’. It aims to discourage pump and dumps during the first few years of operation. For Zooko this represents an annual incentive of around $4.2M based on an exchange rate of $170/ZEC. \n\n After four years, the number of ZEC created every ten minutes will drop to 25, but 100% of it will go to the miners. The end result is that of the total ZEC, 10% (or 2.1 million) will have been distributed to the founders and early stakeholders. \n\n Developers have criticized the security of Zcash, in particular, the ‘ceremony’ which created the zk-SNARK public parameters; this involved six participants who created individual “shards” of the private/public key-pair and then burned them to DVDs. Participants followed a document called “Zcash Multi-party Computation Instructions” to create the shards. \n\n The document provided technical requirements for the hardware used, as well as instructions for downloading the required software and burning the shards to DVDs. The participants then allegedly destroyed their shards of the private key and combined the shards of the public key to create the zk-SNARK public parameters. It is said that all the computers involved were subsequently destroyed to prevent anyone gaining keystroke information. \n\n Technologists argue that there is no proof that participants did not conspire to keep the public key, or that cameras, radio signals or satellites could have been used to retrieve keystroke information.','0','0','2019-09-12 23:09:20','2019-11-02 18:25:49',700946823.17,3141209652.87,0.00,0.00,-0.004466,0.011873,-0.426451,0.054098,-4054.72876500),(1316,4432,33,'DOGE','Dogecoin',0.00259,1.00,0.002051,22536848.70000,1.00,315506183.97,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/doge.svg','1',1,'https://dogecoin.com/','Scrypt','PoW',' ','Dogecoin (DOGE) is a blockchain-based peer-to-peer cryptocurrency which was created in December 2013, as a tongue-in-cheek riposte to Bitcoin, and the crypto world generally. Its branding featured a likeness of a Shiba Inu dog from a ‘Doge’ meme that was popular at the time. By January 2014, it had quickly and unexpectedly generated a large community following and had reached a market capitalization of $60 million. \n\n The idea for Dogecoin was conceived by Jackson Palmer, a marketer at Adobe Systems in Sydney, who tweeted a joke concept combining two of the internet\'s most talked-about topics: cryptocurrency and Doge. Billy Markus, a Portland, Oregon-based gaming geek and IBM software developer, made the concept a reality. According to Markus, it took him about three hours to create Dogecoin. \n\n Markus based Dogecoin on an existing cryptocurrency, Luckycoin, which features a randomized reward that is received for mining a block, although this was later changed to a static block reward in March 2014. In turn, Luckycoin is based on Litecoin, which also uses scrypt technology in its proof-of-work algorithm. He simply changed a few core elements, including replacing the word ‘mine’ with ‘dig’ (because that’s what dogs do). \n\n Markus went live with Dogecoin in his lunch break and within five minutes of launching no longer had enough computer power to dig the currency himself. Its coin supply of 100 billion was set to ensure that each DOGE would remain reasonably priced, and also because it was easier to dig them up. Markus split what he\'d mined 50-50 with Palmer. They each earned  $5,000 from the entire project. \n\n As of 30 June 2015, the 100 billionth Dogecoin had been dug up, while Bitcoin\'s final coin will be mined in 2140. An additional 5.256 billion DOGE are created every year and the supply is said to be infinite. \n\n One significant benefit of DOGE is that miners need only a minute to confirm a transaction, substantially less time than Bitcoin or Litecoin. Additionally, the Dogecoin system has no cap on the number of DOGE that users can dig up. As long as diggers continue operating, the DOGE supply will continue to expand. \n\n Dogecoin’s low transaction fees quickly made it a conduit for traders looking to convert their Bitcoin into cash without having to pay Bitcoin’s steep transaction fees. At several points in the last few years it was one of the top three actively traded cryptocurrencies, and in 2018 had a market cap of $2 billion, despite not having a software update since 2015. \n\n Dogecoin is known for its sustainable and friendly community, which offers assistance to members that are in trouble or have suffered hacks, and donates to interesting charitable causes. Some examples of charitable donations include earmarking $50,000 for the Jamaican bobsled team to go to the 2014 Sochi Winter Olympics, and a $30,000 contribution towards the construction of a well in the Tana River basin in Kenya. \n\n Dogecoin is commonly used for tipping. Users tip other users for posts or contributions on platforms that they believe deserve recognition. The tipping process is available on some popular social platforms through third-party apps. It’s similar to a Facebook ‘like’ but with more impact. \n\n Jackson, Dogecoin’s main spokesman, became disillusioned with the growing number of crypto scams and the emergence of institutional trading, which he believed was a step away from crypto’s original ethos. He left the company in 2015 without making a dime from his hobby project, handing over the development of Dogecoin over to trusted community members. Billy has led a less public life and goes by the pseudonym of Shibetoshi Nakamoto on Twitter.','0','0','2019-09-12 23:09:24','2019-11-02 18:25:49',121572345.00,573923979.22,0.00,0.00,-0.051479,0.128911,-0.113503,-0.049704,-999.56300500),(1317,16713,35,'DCR','Decred',18.16206,1.00,0.063458,1285512.56000,1.00,192828771.08,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/dcr.svg','1',1,'','BLAKE256','PoW/PoS','21000000','','0','0','2019-09-12 23:09:29','2019-11-02 18:25:49',5175157.68,19035541.12,0.00,0.00,0.198281,0.071932,-0.357841,0.269651,3326.92792500),(1318,107672,37,'BAT','Basic Attention Token',0.23460,1.00,-0.004648,24864010.47000,1.00,316926213.00,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/bat.svg','1',1,'','N/A','N/A',' ','Basic Attention Token (BAT) is a utility token that can be used as a unit of account between advertisers, publishers, and users on the BAT platform (a blockchain-based digital advertising and services platform).  According to the website, the Basic Attention Token will “be utilized to directly measure, exchange, and verify attention.” \n\nAn essential element of the BAT ecosystem is Brave, an open-source, privacy-centered browser that blocks ads and trackers by default.  If a user wants to earn BAT, they can change their settings to make ads viewable.  Advertisers buy ads with BAT tokens, which are then dispersed to publishers (for hosting ads) and browser users (for viewing ads). \n\nBrave uses blockchain technology to anonymously monitor user attention so that users and publishers can be compensated accordingly with BAT.  Token holders will be able to use BAT for premium content or services on the BAT platform or tip them to publishers of their choice.  The ambitious goal of BAT is to rid the internet of the current online advertising system (along with the middlemen and trackers) and transform digital advertising so that users maintain their privacy, advertisers achieve higher ROI, and publishers receive more revenue.\n\nFor publishers who want access to their BAT tips, they must first be verified.  By signing up as a verified Brave publisher, content creators can obtain their tokens and even exchange them to a currency of their choice.  At the time of this writing, there are over 28,000 verified Brave publishers which include The Guardian, Archive.org, the Washington Post, SourceForge, Nomics.com, and many others.\n\nBrave Software, the company that created BAT, was founded in 2015 by Brendan Eich (CEO) and Brian Bondy (CTO). Before Brave, Eich created JavaScript and co-founded Mozilla while Bondy spent time at Mozilla and Khan Academy as a senior software engineer.\n\nOn May 31st, 2017, BAT held an ICO and raised $35 million in less than 1 minute. 1 billion BAT tokens were sold while an additional 500 million were retained by the company, for a total of 1.5 billion tokens.\n\nThe BAT project is backed by numerous investors including Founders Fund, Foundation Capital, Propel Venture Partners, Pantera Capital, DCG, and many others.\n\nBrave Software is headquartered in San Francisco.','0','0','2019-09-12 23:09:32','2019-11-02 18:25:49',110273954.31,506348073.73,0.00,0.00,-0.079361,0.292086,-0.006542,0.109278,3750.32253000),(1319,844139,39,'TUSD','TrueUSD',1.00095,1.00,-0.001051,104434631.36000,1.00,180546937.99,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/tusd.svg','1',1,'','N/A','N/A',' ','TrueUSD (TUSD) is a fully collateralized ERC-20 token pegged to the price of the US dollar at a 1:1 ratio.  Introduced in early 2018, TUSD is also the first cryptoasset built on the TrustToken platform.  According to the website, TrueUSD is the “first regulated stablecoin fully backed by the US Dollar.”\n\nTrustToken is an asset tokenization platform for people who want to trade physical assets on a blockchain.  Starting with the creation of stablecoins like TrueUSD, TrustToken hopes to eventually provide the technology and legal structure to tokenize and transact real-world assets on blockchains in a way that is legally enforced, audited, and collateralized.  \n\nThe TrustToken company was co-founded in 2017 by Jai An (CEO), Rafael Cosman (Head of Engineering and Product), Tory Reiss (Head of Partnerships and Business Development), and Stephen Kade.  Before TrustToken, An was a data scientist at Kernel, Cosman was a machine learning engineer at Google, Reiss did business development at Microsoft, and Kade was a cofounder of a startup called NeuroTechX.  At the time of this writing, the company is headquartered in San Francisco.\n\nIn June 2018, TrustToken raised $20 million to further develop the platform.  Investors included Andreessen Horowitz, Founders Fund Angel (Pathfinder), Jump Trading Capital, Foundation Capital, Danhua Venture Capital (DHVC), Distributed Global, ZhenFund, Stanford-StartX, Signia Venture Partners, GGV Capital, and BlockTower Capital.\n\nTrueUSD is regulated by the Nevada Department of Business & Industry because it’s US dollar holdings are stored in numerous bank accounts belonging to different trust companies in that state.  In addition, TrustToken is registered and regulated as a federal Money Service Business by the Financial Crimes Enforcement Network (FinCEN). \n\nUnlike BaseCoin and MakerDao which use algorithms to maintain price stability, TrueUSD keeps its value stable by being asset-backed.  New TUSD is minted when an escrow account receives US dollars.  When a token holder converts TUSD to USD, the commensurate amount of TrueUSD is immediately burned.  Both the creating and burning of TUSD occur automatically with smart contracts on the TrustToken platform.  In this way, the total supply of TrueUSD in circulation is always equal to the money in the escrow accounts.\n\nCohen & Company, a Maryland-based independent accounting firm, provides monthly audits of the collateralized funds held in the escrow accounts.  The results of Cohen & Company’s examinations are published in monthly reports available on the TrustToken blog.\n\nIn April 2019, TrustToken launched five new cryptocurrency stablecoins: TrueGBP which is backed by the British pound, TrueAUD which is backed by Australian dollars, TrueEUR which is backed by Euros, TrueCAD which is backed by Canadian dollars, and TrueHKD which is backed by Hong Kong dollars.','0','0','2019-09-12 23:09:37','2019-11-02 18:25:49',1938637785.64,7992255930.40,0.00,0.00,0.001211,0.000415,0.002841,0.000758,50.18074000),(1320,112392,40,'QTUM','Qtum',2.21169,1.00,0.035071,183839859.56000,1.00,212620452.89,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/qtum.svg','1',1,'','POS 3.0','PoS','107822406','','0','0','2019-09-12 23:09:41','2019-11-02 18:25:49',796595738.22,4069378504.66,0.00,0.00,0.223680,0.312502,-0.266293,0.313638,7807.44045000),(1321,347235,41,'BTG','Bitcoin Gold',8.28236,1.00,0.030473,15895728.63000,1.00,145056541.93,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/btg.svg','1',1,'','Equihash','PoW','21000000','Bitcoin Gold (BTG) is a cryptocurrency created from a hard fork of Bitcoin (BTC).  Bitcoin Gold officially split from the original Bitcoin blockchain on October 24th, 2017. \n\nAccording to the website, the purpose of the Bitcoin Gold project is to restore the original decentralization of Bitcoin mining.  In the early days, Bitcoin (BTC) could be mined using regular computers.  That meant there were individual miners spread throughout the globe, each securing the platform.  However, as the network has grown, the only way to profitably mine BTC is to use ASICs (application-specific integrated circuits).  ASICs are different from CPUs and GPUs in that they do only one thing, but they do it very well.  The use of ASICs has led to a monopolization of Bitcoin mining where a few big companies dominate.  If some of these large mining companies wanted to, they could join forces and issue a 51 percent attack where they control a majority of the network hash rate giving them the power to revise transaction history and prevent new transactions from being confirmed.  \n\nJack Liao, CEO of the Hong King-based mining company Lightning ASIC, first announced the Bitcoin Gold project in July 2017.  Bitcoin Gold changes Bitcoin’s proof-of-work (PoW) algorithm to create a digital asset that doesn’t require expensive, state-of-the-art hardware (ASICs) for mining.  Instead, Bitcoin Gold can be acquired using GPU (graphics processing unit) mining which makes it more accessible and theoretically, restores decentralization in the network. \n\nAs with any other hard fork, to claim Bitcoin Gold, users had to hold the original Bitcoin at the time of the fork to automatically receive an equal amount of Bitcoin Gold at the same address.  For people who held their BTC in hardware wallets, there were no issues.  However, for users who kept their BTC on exchanges, problems arose.\n\nAt the time, some of the largest crypto exchanges (including Coinbase and Kraken) announced they would not support BTG.  Coinbase wrote on their blog: “Information about this fork has been limited and there are concerns about its security and stability.  As a result, we do not believe it is safe to allow support for Bitcoin Gold at this time.”  At the time of this writing, Coinbase and Kraken still do not support BTG.\n\nAfter officially launching on November 1st, 2017, community members criticized the development team after they found that 100,000 BTG coins had been pre-mined.  The dev team responded by saying that the pre-mined funds would be used to support the growth of the Bitcoin Gold ecosystem.  In addition, about five percent were set aside as a bonus for the team.\n\nIn that same month, the official Bitcoin Gold website was compromised and promoted a link to a fake BTG wallet.  Users were encouraged to share their old private keys to claim their free BTG tokens.  Before it was discovered and removed, more than $3.3 million were stolen in this scam. \n\nIn May of 2018, Bitcoin Gold was hacked by attackers who deployed a combination of a 51 percent attack as well as a double-spend attack.  This was done to defraud crypto exchanges since they accept large deposits automatically.  The fraudsters made large Bitcoin Gold deposits on exchanges, and at the same time, sent the same funds to wallets they owned. When exchanges realized the transactions were fake, it was too late. The hackers already withdrew the large BTG deposits from the exchanges and multiplied their funds.  In the end, the hijackers stole more than $18 million in BTG from multiple exchanges, including Bittrex.\n\nHoping to prevent future 51 percent attacks, in June 2018, the Bitcoin Gold project changed their proof-of-work (PoW) algorithm from “Equihash” to “Equihash-BTG.”','0','0','2019-09-12 23:09:44','2019-11-02 18:25:49',67586021.32,302530485.79,0.00,0.00,0.037917,0.094635,-0.529605,0.109776,-2758.23264000),(1322,348628,43,'KCS','KuCoin Shares',1.56861,1.00,0.033222,7538649.86000,1.00,136255252.25,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/kcs.jpg','1',1,'https://www.kucoin.com/#/','N/A','N/A',' ','KuCoin Shares (KCS) is the native token of the KuCoin cryptocurrency exchange.  KuCoin Shares is built on the Ethereum blockchain and follow the ERC-20 token standard.  KCS token holders receive discounts on trading fees on the KuCoin exchange and also earn dividends. \n\nKuCoin is a Hong Kong-based centralized cryptocurrency exchange, founded in 2013 by Michael Gan and a team of cryptocurrency enthusiasts.  Before KuCoin, Gan worked for Ant Financial (an affiliate company of the Alibaba Group), MikeCRM, and KF5.COM.  After four years of development and testing, the KuCoin exchange officially launched in August 2017.  \n\nIn September 2017, KuCoin completed their ICO for KuCoin Shares and following the sale, created 200 million tokens.  Participating investors received 50% of the total supply (100 million KCS).  Founders were allocated 35% of the total supply (70 million KCS) subject to a four-year lock-up period.  The last 15% of the total supply (30 million KCS) were given to early investors and consultants with a two-year lock-up period.\n\nKuCoin plans on buying back and destroying 50% (100 million) of the total token supply over time resulting in a long-term fixed supply of 100 million KuCoin Shares once the buyback is complete.  According to the white paper, 10% of the quarterly profits generated from the KuCoin exchange will be used to buy KCS from the market to be burned.  Buybacks are published to the KCS blockchain explorer, allowing users to audit and confirm that the program is running as it should be.\n\nAll KuCoin Shares token holders with at least 6 KCS receive a dividend call “KuCoin Bonus.”  At the end of each trading day, 50% of that day\'s trading fees are collected and used to buyback KCS from the market.  This KCS is then distributed to KCS token holders based on the size of their holdings.\n\nIn addition to the bonus, KCS holders receive a discounted trading fee, which (at the time of this writing) can be as low as 0.0125%.  If a token holder reaches certain levels, they can qualify for special services like one-on-one investment consultation, customer service Fast-Pass, etc.\n\nKuCoin plans on launching a decentralized exchange in the future that utilizes the KCS token.','0','0','2019-09-12 23:09:47','2019-11-02 18:25:49',78095575.40,535068076.22,0.00,0.00,0.204883,0.380930,-0.128897,0.456588,11739.28597000),(1323,187440,44,'OMG','OmiseGO',0.99803,1.00,0.040294,59501816.10000,1.00,139968943.43,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/omg.svg','1',1,'','N/A','PoS',' ','OmiseGO (OMG) aims to become a decentralized, universal payment processing platform built on the Ethereum blockchain.  The OmiseGO platform is powered by the OMG token and will allow people, businesses, and organizations to send and receive payments in digital currencies as well as fiat.  In effect, OmiseGO hopes to replace legacy payment systems like SWIFT, ACH, and Western Union.  According to the website, the mission of OmiseGO is “to enable people to securely access financial services, invest, exchange and spend digital assets anytime, anywhere.”  \n\nThe OmiseGO project was founded in 2017.  The company behind OmiseGO is Omise, a payment gateway provider headquartered in Thailand.  The team is led by Jun Hasegawa (CEO).  Before Omise, Hasegawa was a Director at Alpha-do Inc and the co-founder and CEO of LIFEmee Inc.  Since 2013, Omise has been facilitating cross-border payments in six Southeast Asian countries.  Omise is also a payment processor for Alipay, which at the time of this writing is the world’s largest mobile payment platform in the world with over 1 billion users.  \n\nOmiseGO’s list of advisors includes some of the biggest names in the cryptosphere including Vitalik Buterin (co-founder of Ethereum), Gavin Wood (also a co-founder of Ethereum), Roger Ver (Executive Chairman of Bitcoin.com) Julian Zawistowski (Director of the Golem Foundation), and Joseph Poon (co-creator of the Lightning Network).  \n\nOmiseGO is building a second layer blockchain on top of the Ethereum network using Plasma architecture.  Plasma is a layer 2 solution for Ethereum that provides a framework for building ‘off-chain’ decentralized apps that are fast, secure, and scalable.  The OmiseGO ecosystem will consist of a decentralized exchange, liquidity provider mechanism, clearinghouse messaging network, and asset-backed blockchain gateway.  With these features, developers can create dApps that offer services like payments, remittances, loyalty programs, and much more.\n\nOmiseGO was created to solve the fragmentation and centralization problems found in the payment processing industry.  Countries have different regulations and many payment processors are incompatible with their competitors which makes it difficult for ordinary people to send value across borders.  In addition, because these payment processors are centralized, they are vulnerable to hacks.\n\nThe ultimate vision of the OmiseGO platform is to launch its own mainnet and allow users to send, receive, and exchange all cryptoassets as well as fiat currencies.  OmiseGO is creating a white-label software development kit (SDK) that will allow businesses and organizations with a unit of value (e.g., reward points, fiat currency, cryptocurrency) to create their own branded wallets which will interact with the OmiseGO platform.  It is also creating a non-custodial decentralized exchange that will facilitate the swapping of the asset by bonding ETH to a smart contract.  For example, if Bob wants Alice to send him Yen but Alice only has US dollars, Alice can send Bob the US dollars using the OmiseGO platform and the decentralized exchange will automatically swap the USD to ETH, then the ETH will be swapped for Yen.  Now that it is in the currency that Bob initially requested, the money will be sent directly to Bob.\n\nThe settlement and clearing of transactions will occur on the OMG blockchain.  The underlying Ethereum blockchain will only be utilized to record the blockchain state.  This configuration allows the project to (theoretically) adopt cross-blockchain compatibility at the second layer.  According to the white paper, Bitcoin and Bitcoin-like systems will be allowed to trade on the OMG blockchain “via a clearinghouse network on the Lightning Network.”\n\nThe project uses a proof-of-stake (PoS) consensus algorithm.  Validators must stake OMG tokens in order to have a chance of verifying new blocks.  The validators earn fees from validating the activity of the blockchain.  If a validator behaves improperly, including deviating from consensus rules, their staked tokens will be burned on the OMG blockchain.  All OmiseGO validators must also run a full Ethereum node since staked OMG tokens are stored on the root chain.\n\nIn July 2017, the project canceled its public ICO because they reached their fundraising goal of $25 million during the pre-sale.  Following the pre-sale, a total of 140.2 million OMG tokens were created.  91.3 million (65.1% of total supply) were distributed to participating investors.  28.0 million tokens (20.0% of total supply) were allocated to OmiseGO for the continued development of the platform.  Team members received 13.9 million (9.9% of total supply) tokens.  The allocations to the project and the team members were subject to a one-year lockup period.\n\nIn September 2017, OmiseGO conducted an airdrop.  Anyone holding a minimum of 0.1 ETH could receive a portion of an OMG token for free.  A total of 7 million tokens (5% of total supply) were given away for this airdrop. \n\nIn April 2019, OmiseGO announced the public Alpha release of the OMG Network on the Ethereum test net.  The project claims they have been able to process millions of transactions with a peak throughput of over 2,700 transactions per second.  At the time of this writing, the Ethereum blockchain supports roughly 15 transactions per second.','0','0','2019-09-12 23:09:50','2019-11-02 18:25:49',192889550.94,884934763.18,0.00,0.00,0.156966,0.218113,-0.350588,0.285404,4578.59599500),(1324,930837,47,'EKT','EDUCare',0.12765,1.00,-0.016514,5201433.62000,1.00,108503919.09,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/ekt.png','1',1,'https://ekt8.io/','N/A','N/A',' ','','0','0','2019-09-12 23:09:52','2019-11-02 18:25:50',38119023.16,197942344.23,0.00,0.00,-0.093398,-0.196026,-0.005596,-0.110882,-5160.06901000),(1325,172091,50,'NANO','Nano',0.86569,1.00,0.025123,1336290.82000,1.00,115351637.61,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/nano.svg','1',1,'','Blake2b','PoW','133248297','','0','0','2019-09-12 23:10:03','2019-11-02 18:25:49',11836162.91,65682193.29,0.00,0.00,0.040045,0.177732,-0.252382,0.088297,1123.57942000),(1326,17778,52,'REP','Augur',9.54132,1.00,0.064971,8559647.08000,1.00,104954502.87,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/rep.svg','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:10:10','2019-11-02 18:25:50',78995179.17,227270547.92,0.00,0.00,0.145596,0.135664,-0.133638,0.182176,4935.46612000),(1328,409492,54,'BCD','Bitcoin Diamond',0.52079,1.00,0.021251,3722670.27000,1.00,97123289.01,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/bcd.svg','1',1,'','X13','PoW/PoS','210000000','','0','0','2019-09-12 23:10:18','2019-11-02 18:25:50',18337045.14,97408985.84,0.00,0.00,-0.031974,0.153770,-0.375808,0.152847,-721.25168000),(1329,19745,56,'LSK','Lisk',0.80022,1.00,-0.000490,688676.89000,1.00,97049954.22,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/lsk.svg','1',1,'','DPoS','DPoS',' ','Lisk (LSK) is a utility token used to pay fees associated with sending transactions on the Lisk blockchain.  The Lisk platform is a decentralized application solution written in JavaScript.  At the time of this writing, JavaScript is the most commonly used programming language in the world.  By utilizing JavaScript, millions of developers have the opportunity to enter the blockchain space and build, publish, distribute, and monetize dApps on the Lisk platform.  According to the white paper, “Developers can quickly deploy their JavaScript apps to Lisk Hosting & Storage Nodes, gain listing in the Lisk Dapp Store, and have immediate access to Lisk Compute Nodes for execution of the code.”  Lisk aims to become the leading platform for decentralized application development in the world.\n\nLisk was founded by Max Kordek and Oliver Beddows.  Before Lisk, Kordek and Beddows were actively involved in the development of the open-source blockchain application platform called Crypti (XCR) which was established in 2014.  After some disagreements with where the Crypti project was headed, Kordek and Beddows created Lisk from a hard fork of Crypti in May 2016.  The Lisk team is headquartered in Zug, Switzerland.\n\nUnlike Ethereum where dApps are executed on the mainchain, Lisk runs decentralized apps utilizing sidechain technology.  Sidechains are autonomous blockchains that are connected to the mainchain but don’t impact the performance or speed of the mainchain.  Sidechains give Lisk interoperability features.  For example, users will be able to transfer and swap tokens between the mainchain and sidechains.  Most importantly, sidechains allow developers to completely customize their decentralized applications.\n\nLisk offers a Sidechain Development Kit (SDK) which features an expanding collection of modules for programming a customized decentralized application.  The SDK includes four tools: Lisk Commander, Lisk Elements, Lisk Core, and the Lisk Hub. \n\nLisk allows token holders to register for usernames which are directly tied to a specific account.  Other users can send transactions to the username and the corresponding account will receive it.  Usernames eliminate the need to memorize long account addresses.\n\nLisk employs the delegated-proof-of-stake (DPoS) consensus mechanism which was originally created by the BitShares (BTS) team.  With DPoS, new blocks are verified and created by 101 delegates.  LSK token holders can vote for up to 101 delegates.  The 101 delegates with the most votes are entrusted to validate new transactions on the blockchain.  Lisk rewards block generators with a fixed amount of tokens for each block successfully created and confirmed by the system.  If a delegate misbehaves or doesn’t properly generate a new block, token holders can remove their votes from that delegate and vote for someone else to replace them.  \nIn March 2016, Lisk announced a partnership with Microsoft to bring the blockchain application platform to the Microsoft Azure cloud.  In that same month, Lisk held a public token sale and raised over $5 million.\n\nOn May 24, 2016, the Lisk mainnet was launched.','0','0','2019-09-12 23:10:21','2019-11-02 18:25:50',8775035.96,57581941.85,0.00,0.00,0.040882,-0.071887,-0.386561,0.052238,-4149.72052000),(1330,20131,59,'WAVES','Waves',0.79631,1.00,0.014564,7444033.06000,1.00,79811444.92,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/waves.svg','1',1,'https://wavesplatform.com/','Leased POS','LPoS',' ','Waves is a blockchain platform that allows you to create your own custom token. According to its website, you can create your own token in less than a minute and use it for projects such as crowdfunding, loyalty reward programs, and in-app currencies. Tokens created on Waves have limited functionality compared to (for example) Ethereum, but are easier to create and require zero coding knowledge. \n\n The Waves coin (WAVES) is the platform’s native currency. You can use WAVES to create a trading pair with your self-made coin on the Waves decentralized exchange (DEX). There are two ways to acquire the currency, you can either install the Waves client on your computer and use its DEX to exchange fiat, Bitcoin, or Ethereum, or you can acquire WAVES through a third-party centralized crypto exchange. \n\n The platform has a Miner Reward Token (MRT) which is awarded to miners or platform members who support them; MRT can also be traded on the open market. To become a miner, a user must have a minimum effective balance of 10,000 WAVES in a personal account. WAVES holders can support the work of miners and earn income without by loaning their balance of tokens to the miners. The miners earn commission from processing the transactions within the platform. \n\n The project was launched in 2016 by Ukrainian entrepreneur Alexander (Sasha) Ivanov, a Theoretical Physics graduate of Moscow State University who pursued postgraduate studies at Leipzig University, Germany. In the same year it launched, Waves held a successful ICO, raising $2 million in less than 24 hours and a total of over $16 million. \n\n The total WAVES token supply is 100 million. One million tokens were distributed to early supporters, one million were put aside for post-ICO bounties, four million were reserved for strategic partners and backers, nine million were withheld by the development team, and 85 million were distributed in the ICO. \n\n The Waves platform itself has been described as a cryptocurrency version of the Kickstarter crowdfunding platform. According to the ICObench tracker, there were around 100 crowdsales on Waves in March 2018 spanning 25 categories. The top two fundraising successes included mobile gaming platform MobileGo, which raised $53 million, and cryptographic pension asset platform Peerbanks, which raised $42.6 million. As of 2018, the Waves platform was most popular among Russian and North American projects. \n\n In September 2018, Waves introduced smart contract functionality to the platform. The new features include multi-sig addresses, token freezing, atomic swaps, and voting. Waves’ smart contracts use a new programming language, RIDE, specifically made for the project. Waves’ smart contracts do not require Gas to execute like (for example) Ethereum. Instead, the network charges a minimal flat fee.','0','0','2019-09-12 23:10:27','2019-11-02 18:25:50',50139113.32,291998298.80,0.00,0.00,0.030920,-0.064298,-0.413867,-0.002848,-5012.67373500),(1331,5293,61,'MAID','MaidSafeCoin',0.13128,1.00,0.071945,358277.13000,1.00,59410664.90,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/maid.svg','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:10:31','2019-11-02 18:25:50',2366723.38,12072941.63,0.00,0.00,-0.048197,-0.163664,-0.202387,0.031820,-3668.76387000),(1332,324068,62,'ICX','ICON',0.16413,1.00,-0.001265,4563217.15000,1.00,82434662.53,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/icx.svg','1',1,'','N/A','LFT',' ','ICON (ICX) is a cryptocurrency that can be used for real-time payments and also as a protocol for connecting blockchains with other blockchains in the ICON Network.  According to the white paper, “The ICON Project aims to build a decentralized network that allows independent blockchains with different governances to transact with one another without intermediaries.” The goal is to build a platform where companies from various industries (e.g., healthcare, insurance, financial, educational, commerce) can interact and transact on a single network.\n\nICON was founded in 2017 by the Seoul based company, IconLoop (formally called theloop).  IconLoop is responsible for creating a private enterprise blockchain solution called loopchain.  The company has partnerships throughout the banking, healthcare, insurance, and financial industries.  IconLoop created ICON (a public blockchain) after hearing from its private enterprise customers that they wanted their private blockchains to have the ability to communicate with one another.  In other words, the companies utilizing loopchain (private blockchains) desired interoperability with other blockchains.  These companies saw the value in sharing data in a public network, thus the ICON network was born.  According to the white paper, anyone can create a new blockchain project and join the ICON network.\n\nIconLoop is owned by the DAYLI Financial Group (DFG), one of the largest fintech groups in South Korea.  DFG also owns Coinone (a popular cryptocurrency exchange in South Korea) as well as DaVinci (the largest AI provider in South Korea).\n\nICON uses a consensus algorithm called delegated proof of contribution (DPoC).  Similar to delegated proof of stake, (DPoS), ICON uses a proxy voting mechanism where token holders delegate their coins to P-Rep (public representative) candidates.  With enough votes, these public representatives will receive control of the network and produce as well as verify blocks on behalf of the users who delegated their coins to them.  The representatives can be changed at any time depending on their contribution level or governance status within the ICON Network.\n\nIn October 2017, ICON held an ICO where half (400,230,000) of the total supply (800,460,000) of ICX was sold to the public.  According to the website, the release schedule of the other 50% of total supply will be determined through annual C-Rep consultation.\n\nIn May of 2018, ICON announced a partnership with LINE, a global social media application company with over 200 million monthly users.  As of the time of this writing, LINE is the most popular messaging app in Japan and Thailand.  Together, ICON and LINE co-founded ‘Unchain,’ which is an effort to construct LINE’s blockchain network. \n\nMin Kim is a cofounder of ICON.  Before ICON, Kim was an investment banker, financial executive, and startup founder. \n\nICON has the backing of well-known partners including Pantera Capital, Kinetic Capital, and CM Crypto Capital.','0','0','2019-09-12 23:10:36','2019-11-02 18:25:50',27020174.01,236889525.39,0.00,0.00,0.077175,-0.003681,-0.322152,0.066525,-1967.21171000),(1334,186277,66,'ZRX','0x',0.29887,1.00,0.001556,22260305.51000,1.00,179843001.58,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/zrx.svg','1',1,'','N/A','N/A',' ','0x (ZRX) is an open protocol that provides infrastructure used to build decentralized exchanges on the Ethereum blockchain.  The 0x project utilizes off-chain transaction relayers and smart contracts to accomplish this.  Users of the protocol pay relayers with the native ZRX token.  In addition, the ZRX token is used for decentralized governance over the protocol’s upgrade system.  ZRX token holders have a voice in how the protocol should be improved over time depending on how many tokens they own.\n\nZRX is an ERC-20 token and as such can be stored in any Ethereum wallet.\n\n0x aims to solve the inefficiencies of decentralized cryptocurrency exchanges.  Although decentralized exchanges are great at security, they lag behind centralized exchanges in user operational costs (higher gas fees) and accessibility (slow). \n\nThe 0x protocol makes decentralized exchanges better by employing off-chain ordering relays together with on-chain settlements.  This allows users to broadcast an order off-chain that another user can fill.  It is only after a value transfer is executed that it is written on-chain, leaving all other trading commands to off-chain procedures.  Transactions are only run on the network when a trade is performed, allowing users to decrease their gas fees when trading.\n\nThe 0x Core Team, co-founded by Will Warren (CEO) and Amir Bandeali (CTO) in October 2016, leads the 0x protocol project.  Before 0x, Warren conducted applied physics research at the Los Alamos National Laboratory while Bandeali worked as a fixed income trader with DRW.  The 0x Core Team is headquartered in San Francisco with members distributed throughout the world.\n\nThe team created 0x OTC, a web app that allows users to trade ERC-20 tokens directly on the Ethereum blockchain using the 0x protocol.  In addition, they’ve created 0x.js, a JavaScript library that simplifies the process of building web apps on top of the 0x protocol. \n\nThe ICO was held on August 15th, 2017 and raised $24 million dollars.  There is a fixed supply of one billion ZRX of which 500 million (50%) were sold in the ICO.  The other 50% was released with 15% retained by the 0x team, 15% going to the developer fund, 10% going to the founding team, and 10% going to advisors and early backers.  The tokens set aside for founders, advisors, and team members are gradually released over the course of four years.  Tokens bought during the launch event were immediately liquid.\n\n0x is backed by the Fintech Blockchain Group, Pantera Capital, Polychain Capital, Jen Advisors, and Blockchain Capital.','0','0','2019-09-12 23:10:44','2019-11-02 18:25:49',50491450.19,289901280.49,0.00,0.00,-0.025135,0.410381,0.401299,-0.036531,8786.57029500),(1335,4430,67,'DGB','DigiByte',0.00687,1.00,0.029583,2137832.86000,1.00,85462864.17,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/dgb.svg','1',1,'','Multiple','PoW','21000000000','DigiByte (DGB) is a digital asset primarily focused on cybersecurity, IoT (Internet of Things) and decentralized currency.  Jared Tate, a programmer and entrepreneur, launched the DigiByte blockchain on January 10th, 2014.\n\nAlthough DigiByte is based on the Bitcoin protocol, a number of adjustments have been made in the code which make DigiByte unique.  For example, DigitByte allows for quicker confirmation speeds (15-second block time versus Bitcoin’s 10 minute block time).  In addition, DigiByte uses five secure and advanced cryptographic mining algorithms (SHA256, Scrypt, Odocrypt, Skein & Qubit) instead of one.  Using multiple mining algorithms prevents the centralization of mining compared to single algorithm blockchains. \n\nAnother difference is DigiByte’s implementation of DigiShield.  DigiShield was activated in February of 2014 and allows for the DigiByte blockchain to protect against multi-pools that mine large numbers of DigiByte at a low difficulty setting.  To achieve this, DigiShield recalculates block difficulty after each new block is mined.  This allows for a faster correction when a multi-pool mining operation begins or ceases contributing to DigiByte (rather than recalculating once every two weeks as is the case with Bitcoin).  Since first being implemented with DigiByte, DigiShield has been added into over 25 other cryptocurrency blockchains such as Dogecoin, Zcash, AuroraCoin, and others.\n\nDigiByte has never held an Initial Coin Offering (ICO) and is not controlled by a private company.  Committed to decentralization, the project is led by the DigiByte Foundation which is a decentralized volunteer-based community dedicated to supporting the DigiByte global blockchain through the three pillars of 1) education, 2) outreach, and 3) development.\n\nIn March of 2019, DigiAssets was announced.  DigiAssets is a scalable secondary layer secured on top of the DigiByte blockchain.  It allows for the decentralized issuance of assets, tokens, smart contracts, digital identity, and much more.\n\nThere are three layers to the DigiByte blockchain.  The first is the Applications layer and functions like an app store where decentralized apps (Dapps) and smart contracts can be built.  Digital assets can also be created on this layer using the DigiAssets protocol.  The second layer is called the Public Ledger layer which is what incentives the security of the DigiByte platform.  The third layer is the Global Network layer which provides communication and operating procedures for all the decentralized nodes (servers, computers, or mobile phones) connected to the DigiByte network.\n\nDigiByte is one of the first projects to implement SegWit (short for Segregated Witness) on their blockchain.  SegWit is a protocol upgrade that changes the way data is stored.\n\nAccording to the website, a total of 21 billion DigiByte will be created within 21 years (2014 - 2035).','0','0','2019-09-12 23:10:50','2019-11-02 18:25:50',8465805.28,33564962.43,0.00,0.00,-0.241106,-0.001900,-0.361811,-0.133809,-8529.85316000),(1336,5039,68,'BTS','BitShares',0.02907,1.00,-0.006907,3313404.52000,1.00,79862941.81,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/bts.svg','1',1,'','SHA-512','PoS','3600570502','','0','0','2019-09-12 23:10:54','2019-11-02 18:25:50',40222540.68,162593593.18,0.00,0.00,0.041193,0.050107,-0.353014,0.131907,-1374.05029000),(1337,714811,69,'THETA','Theta Token',0.09457,1.00,0.005263,2832291.04000,1.00,82324876.77,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/theta.png','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:10:56','2019-11-02 18:25:50',7859936.35,61150998.34,0.00,0.00,-0.005456,0.120264,-0.243185,0.143488,432.45834500),(1338,716522,73,'IOST','IOStoken',0.00684,1.00,-0.023535,38380404.96000,1.00,82182830.58,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/iost.svg','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:10:59','2019-11-02 18:25:50',72783251.89,547646519.84,0.00,0.00,0.491622,0.326183,-0.309029,0.581632,13505.38175500),(1339,731516,74,'NPXS','Pundi X',0.00019,1.00,0.006386,1443079.32000,1.00,43346619.50,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/npxs.png','1',1,'','N/A','N/A',' ','Pundi X (NPXS) is the native utility token that powers the Pundi X platform.  According to the website, “the mission of NPXS is to enable digital currencies to be more accessible to more people across the borders and further increase the utility of digital currencies.”  To accomplish this, Pundi X has built an ecosystem including hardware equipment and software products to help physical retail stores to buy, sell, and accept cryptocurrency. \n\nThe primary hardware product is the Pundi XPOS, a blockchain-enabled point of sale (PoS) device for merchants which can facilitate crypto payments and transactions through mobile wallets.  In addition to processing transactions, Pundi XPOS has its own app store where developers can create applications (such as wallets, insurance services, loyalty programs, retail intelligence, order management, and inventory management systems) for retailers to grow their businesses.  NPXS tokens are required to publish an app on the Pundi XPOS app store.  \n\nThe company plans on rolling out a minimum of 100,000 XPOS units to the global retail market by February 2021.  According to the company, the PoS device has already been shipped to over 30 countries including Australia, Colombia, France, Korea, Switzerland, South Africa, Taiwan, United States, and Uganda.  \n\nThe Pundi X team has also created XPass, a “smart card” where users can buy, sell, and trade cryptocurrencies with a swipe.  With XPass, users can also make purchases at retailers that have the Pundi XPOS system.  The team plans on incentivizing participation in the Pundi X network by offering free XPOS systems to retail stores in select countries. \n\nThe project is backed by the Singapore-based company, Pundi X Labs.  The company was co-founded by Zach Cheah (CEO), Pitt Huang (CTO), and Danny Lim (CFO) in 2017.  Before Pundi X, Cheah spent 12 years in the browser and mobile gaming market, Huang started and sold several startups including a Groupon-like company at the age of 25, and Lim was a product designer with Baidu and Lenovo.\n\nIn January 2018, Pundi X held an ICO for their first token (PXS) and raised $35 million USD.  In the middle of 2018, the project transitioned to the NPXS token. Until September 2018, token holders could swap 1 PXS for 1,000 NPXS.\n\nNPXS is an ERC-20 token utilizing the Ethereum blockchain.','0','0','2019-09-12 23:11:04','2019-11-02 18:25:51',9108137.05,46924358.78,0.00,0.00,0.032231,-0.221769,-0.680845,0.028389,-9659.75957500),(1340,5280,75,'BCN','Bytecoin',0.00038,1.00,-0.022153,9511.13000,1.00,69820324.06,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/bcn.svg','1',1,'','CryptoNight','PoW','184470000000','Bytecoin (BCN) is a privacy-centered cryptocurrency that launched in July 2012.  Based on the CryptoNote protocol which uses ring signatures and stealth addresses, the project claims that transactions are untraceable and unlinkable.\n\nBytecoin (BCN) should not be confused with Bytecoin (BTE), an inactive cryptoasset based off of Bitcoin’s (BTC) protocol.\n\nEach transaction on the Bytecoin network utilizes a one-time public key.  By doing this, the problem of address re-use is eliminated and decreases the traceability of transactions.  To help obscure the connection between users and transactions, ring signatures are used.  With ring signatures, transactions are digitally signed by one member of a group (each having their own private keys), however, there is no way for an outside observer to determine which one actually signed it. \n\nBytecoin uses an egalitarian proof-of-work consensus algorithm called “CryptoNight,” designed to restrict ASIC mining and make CPU and GPU mining equally efficient.  Each block time on the Bytecon blockchain is 2 minutes (compared to Bitcoin’s 10 minute block time).  To maintain a consistent block rate, the mining difficulty changes as the network hash rate increases and decreases after each block.  This protects the blockchain from “freezing up” even when the system traffic spikes or has a sharp drop in the number of miners. \n\nBytecoin is considered one of the first privacy coins to exist in the space.  Monero (XMR), a popular privacy project, is actually a fork from the original Bytecoin protocol.  \n\nSome have criticized Bytecoin’s mining history.  A prominent Monero developer argues that 82% of Bytecoins were pre-mined before the project was released to the public.  Bytecoin has a maximum total supply of 184.47 billion coins.  At the time of this writing, over 99% of the coins are already in circulation.\n\nThe founders of this privacy project are anonymous.','0','0','2019-09-12 23:11:08','2019-11-02 18:25:50',132398.72,756122.40,0.00,0.00,0.045477,-0.084520,-0.334526,0.016036,-4347.13939000),(1341,769546,76,'DAI','Dai',1.00570,1.00,-0.000983,2160082.69000,1.00,89394237.36,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/dai.svg','1',1,'','N/A','N/A',' ','Dai (DAI) is the first decentralized stablecoin on the Ethereum blockchain.  It is soft pegged to the US Dollar meaning the value of 1 Dai is roughly equivalent to $1 USD.  As an ERC20 token, anyone with an Ethereum wallet can own, accept, and transfer Dai.\n\nBecause the price of popular cryptoassets like Bitcoin and Ether are so volatile, few people are using them for everyday purchases.  That is why stablecoins were invented.  Stablecoins are cryptocurrencies that are pegged to other stable assets.  Unlike centralized stablecoins (for example Tether), the stability of Dai does not rely on a trusted third party.  Dai’s price is maintained using smart contracts and external financial incentives that keepers take advantage of.  A keeper is an independent actor (usually automated), who among other things, buys Dai when the market price is below the Target Price (i.e., $1 USD) and sells Dai when the market price is higher than the Target Price in order to gain a profit.\n\nDai is created when a user takes on a Collateralized Debt Position (CDP).  By depositing collateral (e.g., ether) in an Ethereum smart contract, a portion of the value of the locked assets are paid out in Dai.  Just like holding any other cryptocurrency, Dai can be used for various purposes: trading, payments, personal savings account, etc.  To reclaim the collateral from the CDP, the user must repay the borrowed Dai along with an extra stability fee. \n\nUsers can also purchase Dai directly from a broker or exchange.\n\nDai is part of the two-token system on the Maker platform.  Dai is the stablecoin targeting a value of $1 per unit, and Maker (MKR) is the utility token used to pay fees on Dai loans.  The Maker token also enables holders to contribute to platform governance by voting on proposals like increasing or decreasing the stability fee.  Where Dai is for everyday use, Maker - which is not a stablecoin - is specifically for people who want to help govern the Maker platform. \n\nThe MakerDAO (Decentralized Autonomous Organization), co-founded by Rune Christiensen in 2014, is made up of the Maker platform technical infrastructure and the community of Maker token holder (i.e., voters). \n\nAs of the time of this writing, MakerDAO has raised $27 million from investors including Andreessen Horowitz, Polychain Capital, FBG Capital, Walden Bridge Capital, Distributed Capital Partners, Wyre Capital, and more.\n\nMakerDAO is headquartered in Santa Cruz, California and also has offices in New York, Copenhagen, and Warsaw.\n\nMaker and Dai launched together on the Ethereum blockchain in December of 2017.','0','0','2019-09-12 23:11:13','2019-11-02 18:25:50',17836383.52,131516604.11,0.00,0.00,-0.002790,0.001993,0.009709,-0.001320,72.89690000),(1342,26132,77,'KMD','Komodo',0.56716,1.00,0.037201,941207.37000,1.00,66232677.86,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/kmd.svg','1',1,'','Equihash','dPoW/PoW','200000000','','0','0','2019-09-12 23:11:19','2019-11-02 18:25:50',11738758.10,55716753.98,0.00,0.00,0.076578,-0.034810,-0.425504,0.020941,-3664.20643500),(1343,218008,78,'BTM','Bytom',0.13037,1.00,0.140162,47291797.34000,1.00,130693303.73,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/btm.jpg','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:11:22','2019-11-02 18:25:49',31480803.65,178341061.28,0.00,0.00,1.035590,1.330371,0.126869,1.379922,49229.20803000),(1344,13072,80,'SC','Siacoin',0.00210,1.00,0.008686,1388943.87000,1.00,87656552.39,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/sc.svg','1',1,'','Blake2b','PoW',' ','Siacoin (SC) is a utility token that powers the Sia Storage Platform, an open-source, decentralized cloud storage system.  The Sia platform allows users to earn Siacoin by renting out spare hard drive capacity or store files using other people’s spare hard drive space paying them in Siacoin.  The Sia blockchain is secured using a proof of work (PoW) consensus algorithm.  \n\nWhen a user uploads data to the Sia platform, it’s encrypted, divided into several smaller components, and stored on nodes all over the world.  The only way to access the data is to decrypt it with the user’s private keys.\n\nThe Sia network utilizes storage smart contracts where both the “host” (storage provider) and “renter” (user uploading data) lock up some Siacoin in a smart contract escrow along with a transaction fee that the renter pays.  After a specified time chosen by the renter, the system automatically checks to see if the data is still available from the host.  If the host is offline or loses the encrypted data, they forfeit their staked Siacoins in the escrow account.  If the host provides the encrypted data, their collateral is returned and they are paid via the smart contract.  \n\nThe Sia platform also has a secondary, revenue-sharing token called SiaFunds (SF).  This digital asset gives the holder a portion of the transaction fees each time a file is uploaded to the Sia network.  The purpose of SiaFunds is to incentivize token holders to improve the storage platform by bringing on more users.  With more people using the Sia network, SiaFund token holders receive more Siacoin. \n\nThere are only 10,000 SiaFunds and all have been pre-mined.  At the time of this writing, Nebulous Inc., Siacoin’s parent company, owned over 8,000 SaiFunds and the remaining were sold in a crowdfund to help finance early development.\n\nThe idea for Siacoin was conceived in September 2013 by David Vorick and Luke Champine at HackMIT, a student-run hackathon held at the Massachusetts Institute of Technology.  At that time, both Vorick and Champine were undergraduate computer science students at Rensselaer Polytechnic Institute in Troy, New York.\n\nIn May 2014, they cofounded the Boston-based company, Nebulous Inc., the core development team behind the Siacoin project.  In that same month, Nebulous raised $240,000 from a SiaFund sale.  In September 2014, it received a seed round of $750,000 from investors including Procyon Venture and angel investor, Xiaolai Li.  \n\nLess than one year, the first public beta of the Siacoin network was released in March 2015.\n\nIn July 2019, Nebulous closed a $3.5 million pre–Series A round led by Bain Capital Ventures, along with participants like Bessemer Venture Partners and Dragonfly Capital Partners.','0','0','2019-09-12 23:11:26','2019-11-02 18:25:50',4054543.11,26282425.14,0.00,0.00,0.019275,0.293394,-0.220747,0.033571,1742.58962000),(1345,4433,82,'XVG','Verge',0.00383,1.00,0.019615,566004.42000,1.00,61458521.88,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/xvg.svg','1',1,'','Multiple','PoW','16555000000','Verge (XVG) is a privacy-focused cryptocurrency.  Originally created in 2014 as DogeCoinDark, it rebranded to Verge in 2016.  Verge utilizes multiple tools to enhance privacy including Tor (open-source anonymity software) and an anonymous network layer called I2P.  The project claims that locations, IP addresses, and transaction details are obfuscated. \n\nAt the time of writing, there are two wallets that can store Verge: the QT wallet and the Electrum wallet.  Electrum, an open-source Bitcoin lite wallet, was forked by the Verge team and updated so that it could work with the Verge blockchain.  The Verge Electrum wallet is focused on speed.  It uses a technology called, Simple Payment Verification (SPV), which verifies transactions on the Verge blockchain without downloading the whole blockchain.  According to the website, with SPV, average transaction confirmation times take approximately 5 seconds.  The QT wallet requires that users download the full Verge blockchain.  It has built-in TOR integration and SSL encryption which obscures user IP addresses.  \n\nIn January 2018, the project released the Wraith Protocol upgrade.  The Wraith Protocol is a technology that enables users to shift between public and private ledgers on the Verge blockchain.  This means that when transparency is required (e.g., charging customers for regular purchases), a public ledger can be used.  For situations that need anonymity (e.g., sending confidential financial support to an NGO operating in a hostile political environment), then a private ledger can be utilized.\n\nVerge uses five different proof-of-work (PoW) algorithms for mining - 1) Scrypt, 2) X17, 3) Lyra2rev2, 4) myr-groestl, and 5) blake2s.  Not only does this allow more people with different types of mining equipment to be able to mine Verge, but (theoretically) it should also provide greater security through decentralization.\n\nVerge was founded by Justin Erik Valo (a.k.a. Sunerok) who, at the time of this writing, continues as the project’s lead developer.  According to the website, “All contributors, including the Core Team, are unpaid volunteers who donate their time and energy into the project because they are passionate and believe in Verge.”\n\nIn November 2017, 125 million XVG were lost by a wallet app service (CoinPouch) that was recommended by the Verge core team.  While CoinPouch blamed Valo (Verge’s lead developer), Valo turned around and blamed CoinPouch for the incident.\n\nIn April 2018, Verge announced a partnership with Pornhub which, at the time of this writing, is in the top 40 for the most visited sites in the world.  Customers can use XVG to pay for all on-demand products and services.  According to Pornhub, a crypto payment method was one of the most requested features by its users. \n\nIn April 2018, the Verge network fell victim to a 51% attack.  In PoW based blockchains, if a miner (or mining pool) captures 51% or more of the network\'s mining power, they have the ability to double-spend (spend coins that were already spent).  Because the Verge blockchain switches between five different mining algorithms between each block, the attacker found a way to falsify the timestamps of the blocks and mined them with only one algorithm.  To exclude the blocks the attacker already minded, the Verge team implemented a hard fork quickly after the hack was discovered.','0','0','2019-09-12 23:11:28','2019-11-02 18:25:50',4441409.07,27608670.76,0.00,0.00,0.062628,0.192972,-0.354471,0.115214,687.84743500),(1346,5296,86,'MONA','MonaCoin',1.05044,1.00,-0.041400,577862.62000,1.00,69045072.55,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/mona.svg','1',1,'','Scrypt','PoW',' ','MonaCoin (MONA) is a cryptocurrency designed for peer-to-peer transactions via the MonaCoin network.  Calling itself the “first Japanese cryptocurrency,” MonaCoin was created from a hard fork of Litecoin (LTC) in December 2013.  The digital asset is named after \"Monā\" or \"Mona,\" a cat-like figure created using ASCII characters that became a popular meme on the online community 2channel (2chan).  Although MonaCoin is popular within Japan, it’s struggled to find wider relevance in other countries. \n\nThe project was announced on 2chan by the alias, “Mr. Watanabe.”  Watanabe is one of the most common surnames in Japan.  Similarly to Satoshi Nakamoto (the creator of Bitcoin), the true identity of “Mr. Watanabe” is unknown.  \n\nMonaCoin’s proof-of-work (PoW) mining algorithm is designed to be ASIC resistant.  It originally ran Scrypt (just like Litecoin) to fortify itself against ASIC mining but miners figured out a way to build Scrypt-compliant ASICs.  Committed to allowing regular GPUs and CPUs to mine the coin, MonaCoin was moved to the Lyra2REv2 hashing algorithm created by the team behind Vertcoin (VTC).  Monacoin also employs the Dark Gravity Wave v3 algorithm which readjusts its difficulty after each new block (90 second block time).  The total supply of MonaCoin is 105,120,000.  \n\nAlthough the creator of Monacoin is unknown, the project continues to be developed by its community.  MonaCoin was one of the first coins to implement Segwit and has also implemented the Lightning Network on top of the MonaCoin blockchain.\n\nThe MonaCoin Foundation was created in July 2014 by community members who wanted to promote the digital asset in Japan and throughout the world.  According to the website, the primary activities of the foundation are 1) to provide a place where MonaCoin owners can interact with one another and 2) the collection and dissemination of information related to MonaCoin.  Unlike other projects, none of MonaCoin’s developers are members of the foundation.  \n\nIn July 2014, the cryptocurrency was pushed into the national spotlight when Tokyo TV Network, WBS, reported that a man purchased a plot of land in Nagano, Japan with 32,001 MonaCoins and erected a Shinto shrine in honor of the digital asset. \n\nIn 2017, Akihabara (a region known as “the world’s largest electrical equipment marketplace” with thousands of merchants selling every technological device you can think of) began accepting MonaCoin as a form of payment.  More and more shops and restaurants in Japan have followed suit.\n\nIn May 2018, the MonaCoin blockchain was hacked with a selfish mining attack.  The attacker successfully established a longer chain and caused $90,000 in damages.  \n\nIn the fall of 2018, a hacker stole $134,500 worth of MonaCoin from Monappy, a social media network and web-based wallet.  In March 2019, the hacker was caught by the Tokyo police and was the first person in Japan to be charged with crypto theft.','0','0','2019-09-12 23:11:31','2019-11-02 18:25:50',10060868.62,49442233.23,0.00,0.00,-0.053076,-0.107241,-0.456626,-0.033133,-8091.80122500),(1347,328639,89,'ETP','Metaverse ETP',0.50008,1.00,0.030920,778067.07000,1.00,38454520.80,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/etp.svg','1',1,'','Ethash','N/A','100000000','','0','0','2019-09-12 23:11:33','2019-11-02 18:25:51',10013707.44,33149808.05,0.00,0.00,0.505853,-0.076079,-0.376723,0.475440,7376.47221500),(1349,716725,92,'ZIL','Zilliqa',0.00611,1.00,-0.010846,10120763.42000,1.00,53066392.89,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/zil.svg','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:11:39','2019-11-02 18:25:51',27745185.91,156911468.41,0.00,0.00,0.152355,0.159820,-0.390981,0.175542,1395.53975000),(1350,190978,93,'AE','Aeternity',0.22515,1.00,0.015311,32943419.86000,1.00,65158828.83,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/ae.svg','1',1,'','N/A','PoW/PoS',' ','','0','0','2019-09-12 23:11:42','2019-11-02 18:25:50',187631271.83,449603574.43,0.00,0.00,0.021432,0.418383,0.000000,0.230003,8339.59975500),(1351,33022,94,'GNT','Golem',0.04612,1.00,0.016306,835815.46000,1.00,45203555.11,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/gnt.svg','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:11:46','2019-11-02 18:25:51',7998401.07,80640648.88,0.00,0.00,0.033588,-0.013018,-0.231656,-0.000264,-2216.18143000),(1352,30173,97,'ARDR','Ardor',0.05527,1.00,-0.017000,730244.39000,1.00,55219535.04,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/ardr.svg','1',1,'','N/A','PoS','998999495','','0','0',