ens, according to their current price (which is estimated according to a methodology, developed by the Bancor Network team, and defined in the Bancor Protocol whitepaper).  BNT liquidation happens the same way around.  The amount of BNT in circulation is not static as BNT tokens are created each time when ETH is sent to their smart contract.  On the other hand, BNT tokens are destroyed every time a user sells his BNT back to the contract.\n\nBNT’s flexibility is thanks to the Bancor Protocol (the operational model of the Bancor Network), which allows for the standardization of a new type of natively liquid brand token.  The authors of the Bancor Protocol Whitepaper describe the Bancor Network Token as a “token for tokens.” The fundamental pillars of the Bancor Protocol are the so-called “Smart Tokens”.  The smart tokens are ERC20 compliant tokens that hold one or multiple connector balances in their smart contracts.  Thanks to that, smart tokens can be traded against any of the tokens on the network (if they are present in their connector balances).  What all smart tokens have in common though, is that they hold a shared connector balance in BNT.  This makes all of them tradable against each other.  The conversion between tokens happens instantaneously, without the need for matching buyers and sellers and at continuously calculated rates.\n\nThe idea behind the creation of the Bancor Network Token is to ease the use of the Bancor Network and link all tokens into one system that allows for instant and easy conversion.  The operational model of the Network supposes that if there is significant buying interest in a specific token (ETH, for example), it will result into an increased supply of BNT since the supply of its sub token (ETH in that case) has grown through new deposits of BNT into the connector balance.\n\nThe BNT’s Token Generation Event took place on June 12, 2017.  BNT then became the first smart token launched on the Bancor Network (a decentralized cross-chain liquidity network).  The BNT is managed by the Bprotocol Foundation, a nonprofit, headquartered in Zug, Switzerland, that aims to promote the Bancor Protocol as the leading global standard for Smart Tokens.\n\nThe Bancor project has four co-founders - Eyal Hertzog, Galia Benartzi, Guy Ben-Artzi, and Yudi Levi.  All of them are known for their vast experience in the tech field and venture capital industry.  The Bancor Foundation has also attracted industry experts from a variety of industries.  The board of the Foundation consists of 13 members among which can be distinguished the names of Tim Draper, founder of Draper University and Draper Associates, John Henry Clippinger, research scientist at MIT and strategic advisor to multiple organizations, Brock Pierce, Chairman of the Bitcoin Foundation and co-founder of EOS Alliance, Yoni Assia, founder and CEO of eToro, Justin Rosenstein, co-founder of Asana and others.  The Network was lead by the well-respected international monetary policy expert Bernard Lietaer before his death on February 4, 2019.','0','0','2019-09-12 23:13:45','2019-11-02 18:25:57',9514374.07,59092338.54,0.00,0.00,-0.043650,-0.043264,-0.333249,-0.026985,-5103.80859000),(1387,887527,184,'TRUE','TrueChain',0.32840,1.00,0.057269,20540179.08000,1.00,26132507.44,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/true.png','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:13:48','2019-11-02 18:25:54',26949485.07,307304109.85,0.00,0.00,0.439037,0.399614,-0.204749,0.577218,15802.53796500),(1388,5020,186,'WDC','Wisdom Chain',0.16775,1.00,0.224912,388667.66000,1.00,20064184.32,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/WDC.jpg','1',1,'http://www.wisdchain.com/','Scrypt','PoW',' ','The Wisdom Chain is a brand new intelligent contract and communication platform, based on Block Chain, faced to smart city, achieving the Internet of Things for living facilities and interconnection for living information.\r\n\r\nIt aims to provide distributed data connection services for many intelligent items of human being, in order to share the data conveniently between personal terminal and the city intelligence terminal, and to share the Identity (ID) authentication, and can provide a consistent access ability of privilege data.\r\n\r\nAs a full set of solution to build an intelligent city information interconnection, it becomes a connector of a massive number of intelligent systems and devices.\r\n\r\nThe Wisdom Chain, as a bottom supporting system, will be released in the form of Main Chain, supporting parallel running structure of multi-chains and multi level communication protocol, including device interconnection protocol, terminal data sharing, ID authentication and instant communication protocol etc, achieving the network autonomy with the synchronization of node data through the mixture consensus mechanism by the combination of PoW (proof of work) and PoS (proof of stake), finally achieves the main chain faced to the living information interconnection.','0','0','2019-09-12 23:13:54','2019-11-02 18:25:57',3058145.66,14668644.01,0.00,0.00,0.220184,0.324149,-0.398311,0.425586,9967.83755500),(1390,757969,189,'BIX','Bibox Token',0.16308,1.00,0.039180,3109439.59000,1.00,17479574.53,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/bix.png','1',1,'https://www.bibox.com/','N/A','N/A',' ','','0','0','2019-09-12 23:14:00','2019-11-02 18:25:58',34343038.57,244177576.09,0.00,0.00,0.044343,0.127823,-0.414009,0.084715,-1163.44335000),(1391,179896,190,'PPT','Populous',0.53281,1.00,0.046342,1243645.00000,1.00,28373477.85,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/ppt.svg','1',1,'','N/A','N/A','53252246','','0','0','2019-09-12 23:14:02','2019-11-02 18:25:53',8149608.94,18953341.76,0.00,0.00,-0.034919,0.188529,-0.269459,0.343051,3548.15249000),(1392,78152,193,'ANT','Aragon',0.71611,1.00,-0.019770,758.91000,1.00,21340373.07,'1'