incentivized software tools and a unique model of dental insurance (all of which use DCN), Dentacoin hopes to create a new ecosystem that shifts the focus of dentistry from “sick care” to “preventive care.”\n\nDentacoin was created by the Netherlands-based Dentacoin Foundation, which was co-founded in March 2017 by Professor Dimitar Dimitrakiev, Jeremias Grenzebach, and Philipp Grenzebach.  Before Dentacoin, Dimitrakiev was a university lecturer and spent over 27 years in the financial markets.  Jeremias was an early blockchain enthusiast and contributed code to Ethereum, Waves, ZCash, uPort, Status, imToken, and Byteball.  Philipp studied law, economics and business management.  Although the organization is called a “foundation,” the corporate entity is registered as a for-profit business.\n\nThe Dentacoin ecosystem consists of Dentacare, DentaVox, Trusted Reviews, and Assurance. Dentacare is a mobile app that teaches good oral hygiene through a 3-month challenge.  Users can earn DCN from using the app.  DentaVox is a market research platform that collects patient feedback through surveys.  Users are compensated with DCN after each questionnaire is submitted.  Trusted Reviews is a platform for verified dentist reviews.  According to the website, patient identities are verified through the blockchain and are rewarded with DCN for providing honest feedback.  Assurance is a dental insurance-like program where patients pay a low monthly premium in DCN to their dentists and in return receive lifelong, prevention-focused dental care.  DCN can be used to pay for dental treatment, dental care products, or exchanged for other currencies.\n\nThe Dentacoin Foundation believes its ecosystem will benefit dentists as well.  By joining the Dentacoin Network, dentists can earn more stable basic income via Assurance, create a more loyal customer base via Trusted Reviews, and improve customer satisfaction via DentaVox.  Dentists will be able to use DCN to buy dental supplies and dental equipment from participating merchants.\n\nIn June 2017, the Dentacoin Foundation bought Dentaprime, a London-based tooth implant clinic, for 31.5 billion DCN.\n\nAt the time of this writing, there are over 90 locations worldwide participating in the global Dentacoin Network and accept DCN payments.  Dentacoin partners can be found in the United States, Australia, the United Kingdom, Italy, Austria, Netherlands, Germany, Spain, Hungary, Bulgaria, Serbia, Malaysia, Taiwan, Pakistan, Fiji, India, and the United Arab Emirates. \n\nThe max supply of DCN is 8 trillion tokens, all of which have been pre-mined and will be distributed via time-locked contracts as adoption grows.\n\nThe ICO for Dentacoin occurred on October 2017, where 3% of the total supply went on public sale.  They raised approximately $2.6 million.','0','0','2019-09-12 23:17:10','2019-11-02 18:25:58',712614.48,4677566.66,0.00,0.00,-0.124805,-0.211441,-0.297000,-0.286294,-11391.83561500),(1447,178467,324,'WGR','Wagerr',0.08440,1.00,0.041273,38817.90000,1.00,15928755.01,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/WGR.png','1',1,'https://www.wagerr.com/','PoS','N/A',' ','Wagerr uses distributed blockchain technology to execute betting contracts. It escrows stakes, verifies results, and pays out winners. By eliminating central authorities, Wagerr solves the most pernicious problems in the industry. Reducing corruption and risk results in predictable operation. You can bet on Wagerr.','0','0','2019-09-12 23:17:15','2019-11-02 18:25:58',100289.03,403452.23,0.00,0.00,0.144686,1.710864,0.447946,0.310661,31848.23996000),(1448,186875,325,'STORM','Storm',0.00132,1.00,-0.030935,168901.70000,1.00,8365151.72,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/storm.svg','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:17:18','2019-11-02 18:26:01',2573204.50,13855821.33,0.00,0.00,0.031657,0.079829,-0.346297,-0.000711,-2993.37888000),(1449,314580,330,'SALT','