the online and offline retail customer experience.  The foundation of the ecosystem is its patent-pending sensor technology called ION.  Instead of depending on RFID, WiFi, Bluetooth, or even facial recognition technologies, the ION sensor detects customers’ smartphones via radio frequencies when they are within a certain range.  Upon entering a store, the ION sensors will register the customer’s phone and will ask them if they’d be willing to share their information with the store.  If the customer consents, the ION sensors push the data (via Nucleus Vision’s blockchain called “Orbit”) to the Neuron neural network.  The network’s deep-learning algorithms analyze customer data and provide the merchant with real-time customer information (e.g., upcoming life events, purchase history, age, gender, etc.).  \n\nMerchants are required to use nCash tokens to move data throughout the Nucleus Vision network.  In addition, merchants must pay nCash to data providers who give insights about their customers.  To protect user privacy, customers will be able to opt-out of the service at any time.  When users consent to share their information, they will receive nCash tokens which can be used to pay for products and services within the store.\n\nnCash is an ERC-20 token that utilizes the Ethereum blockchain. \n\nAt the time of this writing, Nucleus Vision claims that they have prototypes running in 10 retail stores in India and that they have signed deals with brands to install their technology in 14,000 more locations in the next few years.\n\n\n\nNucleus Vision was founded by Abhishek Pitti in August 2014.  Prior to Nucleus, Pitti worked as an aerospace engineer.  \n\nThe ICO was scheduled for January 2018 but was canceled because, during the pre-sale, they were able to raise the full amount of the hard cap ($40 million).  The total token supply is 10 billion NCASH.  All tokens will be distributed as follows: 40% goes to public participants, 25% is reserved for the company, 25% goes to the development team and employees, 5% goes to advisors, and the last 5% goes to the bounty program.\n\nThe project has been backed by Tim Draper, IndusAge Partners, among other investors.\n\nAt the time this is being published, Nucleus Vision is headquartered in Sunnyvale, California.','0','0','2019-09-12 23:19:27','2019-11-02 18:26:10',2412338.93,16057907.78,0.00,0.00,0.031083,0.028921,-0.371242,0.084879,-2090.92239000),(1482,5282,427,'XDN','DigitalNote',0.00060,1.00,-0.022574,1984.36000,1.00,4416671.79,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/xdn.svg','1',1,'','CryptoNight','PoW','10000000000','','0','0','2019-09-12 23:19:32','2019-11-02 18:26:17',68008.87,194220.15,0.00,0.00,0.103237,0.212418,-0.434830,0.120062,80.12076500),(1483,5325,428,'FLO','FlorinCoin',0.02987,1.00,-0.016189,19545.83000,1.00,4550087.65,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/flo.svg','1',1,'','Scrypt','PoW','160000000','','0','0','2019-09-12 23:19:36','2019-11-02 18:26:16',111846.15,441702.95,0.00,0.00,-0.248720,-0.357129,-0.333352,-0.235543,-14358.57351000),(1484,218107,430,'XAS','Asch',0.08498,1.00,-0.086418,726356.64000,1.00,7933575.75,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/xas.png','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:19:39','2019-11-02 18:26:01',2089504.18,8876005.38,0.00,0.00,0.722963,0.622187,0.132497,0.827862,27381.47082500),(1485,23728,431,'SBD','Steem Backed Dollars',0.71733,1.00,0.021087,33803.62000,1.00,5328725.36,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/steem.svg','1',1,'','N/A','N/A',' ','','0','0','2019-09-12 23:19:42','2019-11-02 18:26:13',167105.61,1334365.21,0.00,0.00,0.078047,0.097636,-0.244036,0.021193,-151.77942500),(1486,713186,433,'DTA','Data',0.00045,1.00,-0.014221,251370.73000,1.00,4371233.37,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/dta.png','1',1,'','N/A','N/A','115000