model. VET is the native token and functions as a store of value, whereas VTHO is used to pay for using and building apps on the blockchain. VTHO is automatically generated by owning VET. By using a dual token model, transaction fees remain more stable compared to a system where there is only one coin.\n\nThe VeChain Foundation, a Singapore based non-profit founded in 2017, maintains the VeChain Thor blockchain. \n\nInstead of using fully decentralized consensus models like PoW or PoS, new blocks on the VeChain Thor blockchain are validated via a “Proof-of-Authority” (PoA) consensus algorithm. An innovation of the Proof of Stake model, PoA consensus uses identity and reputation as the form of stake instead of actual tokens. With VeChain Thor’s version of PoA, 101 known validators (Authority Nodes) produce new blocks on the blockchain. Each Authority Node requires full KYC, a formal application, dedicated hardware for the Node, 250 million VET at a minimum, and ultimately selected by the VeChain Foundation.\n\nBecause the identities and reputations of the validators are at stake, it’s argued that the validators will be held accountable and incentivized to work in the best interest of the network’s growth and security. The benefit of using trusted validators is increased blockchain efficiency which allows for greater scalability and lower transaction fees while still remaining secure. \n\nThere is no mining on the VeChainThor blockchain. A 51% attack would require that 51 of the 101 validators collude with one another, which is unlikely. \n\nVeChain has a Blockchain-as-a-Service (\"BaaS\") platform called ToolChain. ToolChain is a blockchain platform offering services such as product lifecycle management, supply chain process control, data deposit, data certification, and process certification. ToolChain allows businesses of all sizes and technical abilities to utilize blockchain technology.\n\nVeChain has a number of impressive enterprise-grade partners including Walmart China, BYD, Renault, BMW, and PricewaterhouseCooper.\n\nVeChain is headquartered in Shanghai and has satellite offices in Singapore, Paris, Luxembourg, Palo Alto, Tokyo and Hong Kong.','0','0','2019-09-13 15:51:20','2019-11-02 18:25:49',19944300.77,121846874.34,0.00,0.00,0.208065,0.247540,-0.208364,0.267929,7066.03107500),(1826,794350,46,'RVN','RavenCoin',0.02907,1.00,0.016877,3038954.66000,1.00,138593365.20,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/rvn.png','1',1,'','X16R','N/A','21000000000','','0','0','2019-09-13 15:53:06','2019-11-02 18:25:49',23568829.06,192048645.02,0.00,0.00,-0.020503,-0.041410,-0.286629,-0.070777,-4740.05903500),(1827,384605,119,'BNK','Bankera',0.00112,1.00,0.000593,1018.16000,1.00,27633111.86,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/BNK.png','1',1,'https://bankera.com/','N/A','N/A',' ','','0','0','2019-09-13 15:54:49','2019-11-02 18:25:54',38694.68,199996.13,0.00,0.00,-0.053500,-0.136325,-0.386399,0.079633,-5745.99648000),(1828,925440,136,'DGTX','Digitex Futures',0.04173,1.00,0.012323,1312620.53000,1.00,32491869.75,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/dgtx.png','1',1,'','N/A','N/A',' ','','0','0','2019-09-13 15:56:33','2019-11-02 18:25:52',7771218.60,33980237.01,0.00,0.00,-0.101429,0.156923,0.058479,-0.099932,180.29871000),(1829,890624,182,'ODE','ODEM',0.15319,1.00,0.051376,8825.51000,1.00,35287848.68,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/ode.png','1',1,'','N/A','N/A',' ','','0','0','2019-09-13 15:58:18','2019-11-02 18:25:51',77471.12,903682.93,0.00,0.00,0.310429,0.574214,-0.301447,0.166013,9970.28345500),(1830,768219,193,'FSN','Fusion',0.72736,1.00,-0.019923,4369283.31000,1.00,25686427.50,'1','https://s3.us-east-2.amazonaws.com/nomics-api/static/images/currencies/fsn.png','1',1,'','N/A','N/A',' ','','0','0','2019-09-13 16:00:03','2019-11-02 18:25:54',16533797.14,104573352.26,0.00,0.00,1.3385