come centralized.  Instead, the project created and uses a consensus mechanism called pure proof-of-stake (PPoS).  With the PPoS algorithm, all users are randomly, anonymously, and consistently selected to partake in the Algorand consensus protocol.  New blocks are created in two phases.  First, a single token holder is randomly chosen to propose the next block.  Afterward, 1,000 other token holders are randomly and anonymously selected to be part of a “committee” to approve the block proposed by the user in step one.  If there is consensus with the new block, it gets added to the blockchain.  All online token holders have the opportunity to be selected to propose and to vote. The probability of a specific user being chosen is directly proportional to how many Algos they have staked.  \n\nIn February 2018, Algorand received $4 million in seed funding from venture capital firms Pillar and Union Square Ventures. In October 2018, the company raised an additional $62 million to fund protocol development.  According to the press release, “The $62M comes from a broad global investment group representing the venture capital, cryptocurrency, and financial services communities.”\n\nThe total max supply of Algos is stated to be 10 billion.  All 10 billion tokens were minted in the genesis block.  The Algorand Foundation will distribute Algo tokens via a series of Dutch Auctions (a sale where the price is progressively reduced until a buyer is found).  The first auction was conducted on June 19th, 2019 where 25 million tokens were sold raising $60 million.  The foundation will continue to conduct regular public auctions with a total auction supply of up to 600 million Algos per year over the next five years until the circulating supply hits 10 billion.\n\nAt the time of this writing, Algorand is headquartered in Boston, Massachusetts.','0','0','2019-10-22 18:55:21','2019-11-02 18:25:49',577057985.85,1469012171.19,0.00,0.00,0.226538,0.169664,0.000000,0.000000,5903.71374500),(21